INSERT INTO `kartu_pemeliharaan` (`id`, `tanggal`, `kode_pemeliharaan`, `id_komponen_pokok`, `id_komponen_sub_pokok`, `id_sistem`, `id_sub_sistem`, `id_pelaksana`, `id_lokasi`, `id_kapal`, `komponen`, `uraian_pemeliharaan`, `tindakan_pengamanan`, `prosedur`, `alat_kerja`, `jo`, `created_at`, `updated_at`, `user_create`, `id_periode`, `tgl_mulai`, `id_jenis_perawatan`) VALUES
(1, '2022-01-01', 'P.101010101000/H', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Periksa komponen Main Diesel  secara visual', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa secara visual komponen sistem untuk kekencangan </li><li>Periksa level bahan bakar minyak di tangki harian </li><li>Cek viscosimat dengan melakukan pengukuran perbandingan suhu </li><li>Periksa level oli pelumas di tangki servis untuk pelumasan engine dan silinder </li><li>Periksa level air pendingin pada tangki kompensasi </li><li>Periksa sistem pengembalian air pendingin katup injeksi Jika sistem dipasang </li><li>Kuras tangki udara terkompresi (jika tidak ada drainase otomatis) </li><li>Kontrol sistem udara, Kuras pemisah air dan filter udara </li><li>Mengisi pendingin udara/pipa: Periksa drainase air kondensasi untuk kuantitas </li><li>Periksa kerapatan gas buang (T2), tekanan pengapian dan Ambil data operasi </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:51', 20220101, 1, '2022-01-01', 1),
(2, '2022-01-01', 'P.101010101000/150JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Periksa dan bersihkan komponen Main Diesel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa perlindun korosi pada sistem air pendingin </li><li>Bersihkan filter oli bahan bakar Sesuai kebutuhan </li><li>Overhaul pompa pengiriman bahan bakar Sesuai spesifikasi </li><li>Ganti pengisian oli Sesuai kebutuhan </li><li>Overhaul pompa minyak pelumas Sesuai kebutuhan </li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan </li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan </li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan </li><li>Bersihkan pendingin oli pelumas Sesuai kebutuhan </li><li>Periksa ruang air pendingin, bersihkan sistem secara kimia Sesuai kebutuhan </li><li>Bersihkan Heat exchanger, charge air cooler Sesuai kebutuhan </li><li>Periksa elemen kontrol dan pemantauan Sesuai kebutuhan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:57:52', 20220101, 18, '2022-01-01', 2),
(3, '2022-01-01', 'P.101010101000/250JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Periksan sampel oli pada engine dan lakukan overhaul dan pembersihan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa sampel oli (spot test) </li><li>Periksa suku cadang yang dipasang dalam kondisi baru atau rekondisi </li><li>Bersihkan filter bahan bakar minyak Sesuai kebutuhan </li><li>Overhaul pompa pengiriman bahan bakar Sesuai spesifikasi </li><li>Ganti pengisian oli Sesuai kebutuhan </li><li>Overhaul pompa minyak pelumas Sesuai kebutuhan </li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan </li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan </li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan </li><li>Bersihkan pendingin oli pelumas Sesuai kebutuhan </li><li>Periksa ruang air pendingin, bersihkan sistem secara kimiawi Sesuai kebutuhan </li><li>Bersihkan tangki udara terkompresi di bagian dalam, perbaiki katup Sesuai kebutuhan </li><li>Bersihkan charge air cooler Sesuai kebutuhan </li><li>Periksa elemen kontrol dan pemantauan Sesuai kebutuhan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:08', 20220101, 20, '2022-01-01', 2),
(4, '2022-01-01', 'P.101010101000/500JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Lakukan pengambilan sampel minyak untuk dianalisis serta lakukan pembersihan dan pemeliharaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Ambil sampel minyak untuk dianalisis</li><li>Bersihkan filter oli bahan bakar Sesuai kebutuhan</li><li>Ganti pengisian oli Sesuai kebutuhan</li><li>Overhaul pompa minyak pelumas Sesuai kebutuhan</li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan</li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan</li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan</li><li>Bersihkan pendingin oli pelumas Sesuai kebutuhan</li><li>Periksa ruang air pendingin, bersihkan sistem secara kimia Sesuai kebutuhan</li><li>Bersihkan penukar panas pada ruang pendingin Sesuai kebutuhan</li><li>Bersihkan tangki udara terkompresi di bagian dalam, perbaiki katup Sesuai kebutuhan </li><li>Bersihkan charge air cooler Sesuai kebutuhan</li><li>Periksa elemen kontrol dan pemantauan Sesuai kebutuhan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:37', 20220101, 23, '2022-01-01', 2),
(5, '2022-01-01', 'P.101010101000/1500JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Periksan dan bersihkan komponen dan lakukan overhaul pada pompa pengiriman bahan bakar', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li><span style=\"font-size: 1rem;\">Periksa monitor dan peralatan kontrol, Periksa titik sakelar berfungsi dengan benar</span></li><li><span style=\"font-size: 1rem;\">Periksa rocker arm dan sambungan baut yang relevan (secara visual) </span></li><li><span style=\"font-size: 1rem;\">Periksa katup masuk dan buang, cek rotasi yang benar selama operasi, p</span>eriksa celah katup </li><li>Lepas dan periksa semua sekrup penyekat (secara visual) </li><li>Periksa bagian yang dipasang dalam kondisi baru atau rekondisi </li><li>Bersihkan filter oli bahan bakar (tergantung pada tekanan diferensial) Sesuai kebutuhan </li><li>Overhaul pompa pengiriman bahan bakar Sesuai spesifikasi </li><li>Ganti pengisian oli, bersihkan tangki Sesuai kebutuhan </li><li>Overhaul pompa minyak pelumas Sesuai kebutuhan </li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan </li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan </li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan </li><li>Bersihkan pendingin oli pelumas Sesuai kebutuhan</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:57:43', 20220101, 25, '2022-01-01', 2),
(6, '2022-01-01', 'P.101010101000/3000JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Lakukan pemeriksaan dan pembersihan komponen, lakukan penggantian komponen jika diperlukan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lepas dua katup buang dan periksa dudukan katup </li><li>Lepaskan dan ganti semua sekrup penyekat </li><li>Lumasi semua titik dan sambungan bantalan. Periksa berfungsi dengan baik </li><li>Lepaskan katup injeksi, periksa elemen nosel atau ganti dengan elemen nosel baru atau rekondisi jika perlu </li><li>Bersihkan filter bahan bakar minyak sesuai kebutuhan </li><li>Ganti pengisian oli, bersihkan tangki Sesuai kebutuhan </li><li>Overhaul pompa minyak pelumas Sesuai kebutuhan </li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan </li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan </li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan </li><li>Periksa, bersihkan dan overhaul separator minyak pelumas Sesuai kebutuhan </li><li>Bersihkan pendingin oli pelumas Sesuai kebutuhan </li><li>Periksa ruang air pendingin, bersihkan sistem secara kimiawi Sesuai kebutuhan </li><li>Bersihkan pendingin udara pengisian di kedua sisi Sesuai kebutuhan </li><li>Pantau dan kendalikan elemen dan peralatan agar berfungsi dengan baik </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:21', 20220101, 27, '2022-01-01', 2),
(7, '2022-01-01', 'P.101010101000/6000JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Lakukan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa dan lepaskan salah satu cangkang bantalan. Jika cangkang bantalan tidak dapat digunakan lagi, periksa semua bantalan</li><li>Lepas, bersihkan dan periksa satu piston. ukur jarak bebas bahu (tidak untuk 32/40 dan 48/60), ring piston dan alur ring</li><li>Periksa drainase oli piston, main bearing, pada gear box dan turbocharger (secara visual)</li><li>Periksa drainase oli bantalan poros bubungan, pompa injeksi dan roda gigi katup di selubung lengan ayun (secara visual) </li><li>Bersihkan kontrol sistem udara pada pemisah air dan filter udara </li><li>Periksa tegangan baut pada pondasi, Periksa baut kopling apakah pas, Periksa sumbat, braket, dan elemen penahan&nbsp;</li><li>Periksa roda gigi berjalan (secara visual) </li><li>Ukur defleksi Crankshaft, periksa  jarak aksial bantalan </li><li>Periksa cangkang bantalan. Jika cangkang bantalan tidak dapat digunakan lagi, periksa semua bantalan</li><li>Periksa roda gigi ukur reaksinya, periksa cam, roller, dan pengikut cam (secara visual) </li><li>Periksa semak-semak pengikut cam pada satu silinder </li><li>Lepas dua katup masuk. Periksa kursi katup. Periksa rotator katup, ganti suku cadang yang aus </li><li>Lepas semua katup buang. Periksa ulang dudukan katup. Periksa panduan katup </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:44', 20220101, 29, '2022-01-01', 2),
(8, '2022-01-01', 'P.101010101000/12000JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Lakukan pemeriksaan komponen dan overhaul piston penyangga', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa/overhaul piston penyangga</li><li>Lepas, bersihkan dan periksa semua piston. Ukur jarak bebas bahu (tidak untuk 32/40 dan 48/60) dan alur cincin. Ganti semua ring piston</li><li>Lepas satu pin piston. Periksa bushing pin piston, ukur jarak bebasnya</li><li>Bongkar satu piston. Bersihkan komponen. Periksa ruang pendingin dan saluran pendingin untuk endapan kokas. Jika ketebalan lapisan melebihi 1 mm, bongkar semua piston</li><li>Ukur dan perbaiki semua liner silinder</li><li>Lepas, bersihkan dan periksa semua kepala silinder</li><li>Periksa katup pengaman di penutup bak mesin, cek semua katup untuk pergerakan yang mudah</li><li>Periksa bubungan, rol, dan pengikut bubungan (secara visual) untuk mesin tipe-V</li><li>Periksa semak-semak pengikut bubungan pada satu silinder untuk mesin tipe-V</li><li>Lepas semua katup masuk. Periksa dan giling ulang dudukan katup. Periksa rotator katup, dan ganti jika perlu</li><li>Lepas dan overhaul semua katup pilot udara start</li><li>Lepas dan overhaul semua katup start\r\n13. Lepas dan overhaul katup start utama </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:57:34', 20220101, 31, '2022-01-01', 2),
(9, '2022-01-01', 'P.101010101000/24000JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Periksa katup kontrol dan pembersihan filter oli bahan bakar dan filteroli pelumas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bongkar katup kontrol dari sistem 10 dan 30 bar, ganti suku cadang yang aus </li><li>Katup pengaman di kepala silinder: Lepas dan bersihkan semua katup. Periksa tekanan pembukaan </li><li>Periksa peredam getaran poros engkol, cek pegas lengan </li><li>Bersihkan filter oli bahan bakar (tergantung pada tekanan diferensial) Sesuai kebutuhan </li><li>Ganti pengisian oli, bersihkan tangki Sesuai kebutuhan </li><li>Overhaul pompa minyak pelumas Sesuai kebutuhan </li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan </li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan </li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan </li><li>Periksa, bersihkan dan overhaul separator minyak pelumas Sesuai kebutuhan </li><li>Bersihkan pendingin oli pelumas Sesuai kebutuhan </li><li>Bersihkan pendingin udara pengisian di kedua sisi air dan udara Sesuai kebutuhan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:57:59', 20220101, 32, '2022-01-01', 2),
(10, '2022-01-01', 'P.101010101000/30000JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Pemeriksaan pipa gas buang dan overhaul pompa minyak pelumas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa pipa gas buang, cek sambungan flensa dan kompensator dari kebocoran (secara visual) </li><li>Lepas semua katup buang, ganti kerucut katup </li><li>Lepas, bongkar dan periksa semua pompa injeksi bersama dengan drive dan pengikut cam. Ganti elemen pompa </li><li>Bersihkan filter oli bahan bakar (tergantung pada tekanan diferensial) Sesuai kebutuhan </li><li>Ganti pengisian oli (tergantung hasil analisa), bersihkan tangki Sesuai kebutuhan </li><li>Overhaul pompa minyak pelumas Sesuai kebutuhan </li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan </li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan </li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan </li><li>Periksa ruang air pendingin, bersihkan sistem secara kimiawi (sistem pendingin silinder dan katup injeksi) Sesuai kebutuhan</li><li>Bersihkan ruang pendingin Penukar panas </li><li>Bersihkan pendingin udara pengisian di sisi air dan udara </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:14', 20220101, 33, '2022-01-01', 2),
(11, '2022-01-01', 'P.101010101000/36000JAM', 2, 1, 1, 1, 8, 1, 0, 'Main Diesel Engine', 'Pembersihan dan penggantian komponen yang aus', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Ganti semua cangkang bantalan</li><li>Lepas, bersihkan dan periksa semua liner silinder. Ganti cincin penyegel</li><li>Lepaskan semua katup masuk, ganti kerucut katup</li><li>Bersihkan filter oli bahan bakar (tergantung pada tekanan diferensial) Sesuai kebutuhan</li><li>Ganti pengisian oli (tergantung hasil analisa), bersihkan tangki Sesuai kebutuhan</li><li>Bersihkan filter servis oli pelumas Sesuai kebutuhan </li><li>Bersihkan filter indikasi oli pelumas Sesuai kebutuhan</li><li>Bersihkan preheater minyak pelumas Sesuai kebutuhan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:29', 20220101, 34, '2022-01-01', 2),
(12, '2022-01-01', 'P.101010102000/100JAM', 2, 1, 1, 1, 8, 1, 0, 'Gear Box', 'Lakukan pemeriksaan komponen dan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Kencangkan semua sambungan sekrup yang dapat diakses dari luar</li><li>Periksa pengaturan shift aktuasi mekanis </li><li>Lakukan penggantin oli </li><li>Mengganti kartrid filter dan membersihkan filter pengambilan daya </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:59:08', 20220101, 17, '2022-01-01', 2),
(13, '2022-01-01', 'P.101010102000/1000JAM', 2, 1, 1, 1, 8, 1, 0, 'Gear Box', 'Melakukan inspeksi komponen secara visual, pembersihan dan kalibrasi perangkat', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa level oli dan melakukan inspeksi visual </li><li>Membersihkan bagian luar transmisi </li><li>Mengencangkan kembali semua sambungan sekrup yang dapat diakses dari luar </li><li>Memeriksa pengaturan shift aktuasi mekanis </li><li>Melumasi bagian eksternal yang bergerak dari aktuasi mekanis </li><li>Mengganti oli, kartrid filter dan membersihkan filter pengambilan daya</li><li>Melakukan inspeksi visual pada kopling fleksibel torsi dan pada cakram kopling</li><li>Melakukan inspeksi visual pada pemasangan transmisi fleksibel dan pemasangan engine fleksibel</li><li>Melakukan inspeksi visual saat menjalankan gearing dan Memeriksa unit aktuasi listrik dan mekanik</li><li>Memeriksa pompa minyak, unit kontrol dan blok katup dari pengambilan daya dan rem poros</li><li>Mengkalibrasi ulang perangkat tampilan </li><li>Memeriksa dan membersihkan pendingin oli transmisi&nbsp;</li><li>Memeriksa katup tabung injektor, cincin penyegelan poros dari poros input dan poros keluaran</li><li>Memeriksa dan membersihkan rem take-in daya secara visual dan peralatan tambahan secara visual </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:58:59', 20220101, 17, '2022-01-01', 2),
(14, '2022-01-01', 'P.101010102000/3B', 2, 1, 1, 1, 8, 1, 0, 'Gear Box', 'Pemeriksaan komponen dan pembersihkan pendingin oli transmisi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa level oli </li><li>Memeriksa secara visual dan membersihkan pendingin oli transmisi </li><li>Melakukan inspeksi visual komponen secara keseluruhan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:59:23', 20220101, 6, '2022-01-01', 1),
(15, '2022-01-01', 'P.101010102000/6B', 2, 1, 1, 1, 8, 1, 0, 'Gear Box', 'Pemeriksaan komponen dan pemberian pelumas', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa level oli </li><li>Melakukan inspeksi visual dan membersihkan bagian luar transmisi </li><li>Mengencangkan kembali semua sambungan sekrup yang dapat diakses dari luar </li><li>Memeriksa pengaturan shift aktuasi mekanis </li><li>Melumasi bagian eksternal yang bergerak dari aktuasi mekanis </li><li>Melakukan inspeksi visual pada kopling fleksibel torsi </li><li>Memeriksa dan membersihkan rem take-in daya  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:59:30', 20220101, 8, '2022-01-01', 1),
(16, '2022-01-01', 'P.101010102000/2T', 2, 1, 1, 1, 8, 1, 0, 'Gear Box', 'Pemeliharaan dan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa level oli </li><li>Memeriksa secara visual dan membersihkan pendingin oli transmisi </li><li>Membersihkan bagian luar transmisi </li><li>Mengencangkan kembali semua sambungan sekrup yang dapat diakses dari luar </li><li>Memeriksa pengaturan shift aktuasi mekanis </li><li>Melumasi bagian eksternal yang bergerak dari aktuasi mekanis </li><li>Mengganti oli dan mengganti kartrid filter </li><li>Membersihkan filter pengambilan daya dan melakukan inspeksi visual pada kopling fleksibel torsi </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:59:16', 20220101, 10, '2022-01-01', 1),
(17, '2022-01-01', 'P.101010103000/T', 2, 1, 1, 1, 8, 2, 0, 'Sistem kontrol Mesin Pendorong', 'Periksa komponen dan lumasi bagian yang bergerak', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa semua pipa hidrolik, dan fitting dari karat dan kebocoran. Cat, kencangkan dan perbaiki jika ditemukan kekurangan</li><li>Periksa semua selang hidrolik dari kebocoran atau tanda-tanda aus</li><li>Periksa oli hidrolik dari kontaminasi. Isi ulang minyak ketika ditemukan pada kondisi tingkat rendah</li><li>Ganti elemen filter hidraulik, ketika indikator pengukur berada di indikasi tanda MERAH</li><li>Periksa apakah pengukur tekanan dalam kondisi baik. Ganti jika tidak berfungsi dengan baik</li><li>Lumasi semua bagian yang bergerak, pin, celah silinder &amp; sakelar batas Dll </li><li>Periksa komponen individu seperti sakelar pemutus keras, pemancar kemudi Dll, koneksi dan kabel listrik direkomendasikan. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:59:38', 20220101, 9, '2022-01-01', 1),
(18, '2022-01-01', 'P.101010104000/T', 2, 1, 1, 1, 8, 3, 0, 'Propeller', 'Pemeliharaan dan pembersihan propeller', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan daun propeller </li><li>Lakukan penambahan bahan (sesuai material propeller) dengan las Pada bagian-bagian propeller yang mengalami pengikisan</li><li>Setelah dilakukan penambahan ketebalan, selanjunya digerinda dan dihaluskan permukaan daun propeller hingga sesuai dengan kondisi awal dengan bentuk dan ketebalan yang sama</li><li>Langkah terakhir adalah balancing propeller </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:00:36', 20220101, 9, '2022-01-01', 1),
(19, '2022-01-01', 'P.101010105000/3B', 2, 1, 1, 1, 8, 4, 0, 'Poros Baling-baling', 'Pemeriksaan dan pemeliharaan poros baling baling', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Menjaga kebersihan poros Propeller </li><li>Periksa poros propeller dari kerusakan atau kebengkokan. Bila kebengkokan poros lebih besar dari nilai maksimum perbaiki poros </li><li>Periksa bantalan spider dari keausan atau kerusakan </li><li>Periksa gerak bebas aksial bantalan spider dengan memutar yoke sambil menahan kuat poros propeller.Kebebasan axial max. 0.05 mm</li><li>Periksa clearance antara universal joint spider </li><li>Pemeriksaan keseimbangan/ balance poros propeller </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:00:45', 20220101, 6, '2022-01-01', 1),
(20, '2022-01-01', 'P.101010106000/4T', 2, 1, 1, 1, 8, 4, 0, 'Bracket dan Bearing', 'Pemeliharaan dan pengecekan bracket dan bearing', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pastikan clearance shaft bracket bearing sesuai standard</li><li>Verifikasi keselarasan dengan garis tengah</li><li>Periksa level oli pada dipstick bantalan</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:00:52', 20220101, 12, '2022-01-01', 1),
(21, '2022-01-01', 'P.101010107000/4T', 2, 1, 1, 1, 8, 5, 0, 'SternTube', 'Membersihkan stern tube dan melakukan pengukuran', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan Stern tube dari kotoran, kerang-kerang yang menempel, dan sisa oli yang menempel</li><li>Lakukan penggantian Zinc Anode untuk mengurangi laju korosi</li><li>Lakukan pengukuran ketebalan material dan lakukan penggantian jika ketebalan berkurang</li><li>Cek dudukan bantalan dari keausan, baut-baut patah dan diperbaiki dengan cara dibor kemudian ditap dan dipasangkan baut kembali</li><li>Periksa seal-seal atau gland-gland, konfirmasikan pengamanan jepitan-jepitan stern gland flexible dan pipa karet bila perlu </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:01', 20220101, 12, '2022-01-01', 1),
(22, '2022-01-01', 'P.101010108000/300JAM', 2, 1, 1, 1, 8, 3, 0, 'Rudder', 'Melkaukan pengecekan dan penggantian remes packing', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek kekedapan piston </li><li>Ganti remes packing batang kemudi </li><li>Ganti remes packing pada katup throttle </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:25', 20220101, 21, '2022-01-01', 2),
(23, '2022-01-01', 'P.101010108000/1000JAM', 2, 1, 1, 1, 8, 3, 0, 'Rudder', 'Periksa minyak hidrolik, flexible house dan seluruh sambungan-sambungan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa minyak hidrolik dan ganti setelah 3000 jam oprasi </li><li>Cek flexible house </li><li>Cek seluruh sambungan-sambungan </li><li>Cek pen pengikat pada kepala batang torak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:10', 20220101, 24, '2022-01-01', 2),
(24, '2022-01-01', 'P.101010108000/3000JAM', 2, 1, 1, 1, 8, 3, 0, 'Rudder', 'Pengecekan komponen dan penggantian minyak hidrolik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Ganti minyak hidrolik </li><li>Cek katup dan penyetelan katup </li><li>Ganti  flexible  house  setelah  4  tahun </li><li>Pastikan tidak ada kebocoran pada sistem hidrolik </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:17', 20220101, 27, '2022-01-01', 2),
(25, '2022-01-01', 'P.101010109000/H', 2, 1, 1, 1, 8, 6, 0, 'Engine Control Console', 'Pengecekan Engine Control Console', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek nilai status pengoperasian sistem, periksa alarm dan shutdown</li><li>Penilaian visual dan suara dari sistem </li><li>Pengecekan data performa dan konsumsi </li><li>Periksa isi semua tangki yang berisi media operasi </li><li>Periksa data pengoperasian mesin dan yang paling penting kondisi sekitar </li><li>Periksa mesin, turbocharger, generator/baling-baling untuk kelancaran. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:35', 20220101, 1, '2022-01-01', 1),
(26, '2022-01-01', 'P.101010109000/M', 2, 1, 1, 1, 8, 6, 0, 'Engine Control Console', 'Periksa sistem Engine Control Console', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa printer atau alat perekam </li><li>Periksa semua data operasi yang relevan </li><li>Mengevaluasi stabilitas pengatur kecepatan dan hubungan kontrol</li><li>Periksa getaran yang tidak biasa dan kebisingan yang luar biasa </li><li>Periksa semua sistem, unit dan komponen utama untuk kinerja yang tepat </li><li>Periksa kondisi media operasi. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:45', 20220101, 2, '2022-01-01', 1),
(27, '2022-01-01', 'P.101010110000/3B', 2, 1, 1, 1, 8, 7, 0, 'Steering Gear', 'Pemeriksaan Steering Gear', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa semua pipa hidrolik, dan fitting dari karat dan kebocoran </li><li>Periksa semua selang hidrolik dari kebocoran atau tanda-tanda aus </li><li>Periksa oli hidrolik dari kontaminasi. Isi ulang minyak ketika ditemukan pada kondisi tingkat rendah</li><li>Ganti elemen filter hidraulik, saat indikator pengukur berada pada indikasi tanda MERAH. Periksa apakah pengukur tekanan dalam kondisi baik Ganti jika tidak berfungsi dengan baik</li><li>Periksa apakah pengukur tekanan dalam kondisi baik. Ganti jika tidak bekerja dengan benar</li><li>Pompa atau lumasi tiller arms dan semua bagian yang bergerak, pin, celah silinder &amp; sakelar batas</li><li>Inspeksi berkala komponen seperti sakelar pemutus, rudder transmitter, Koneksi kabel listrik, Dll </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:52', 20220101, 6, '2022-01-01', 1),
(28, '2022-01-01', 'P.201010101000/60JAM', 3, 2, 2, 2, 8, 8, 0, 'Main Diesel Generator', 'Pengecekan komponen Main Diesel Generator', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek Eksterior mesin dari kehilangan oli dan cairan pendingin</li><li>Cek level Coolant dan level oli Engine</li><li>Cek Konsentrasi agen anti korosi</li><li>Cek sistem alarm Engine untuk fasilitas berhenti darurat</li><li>Cek Fungsi instrumen</li><li>Cek Pemanasan awal, fungsi, pengaturan Coolant</li><li>Cek selang Pendingin untuk kebocoran dan porositas</li><li>Cek saluran bahan bakar untuk kebocoran</li><li>Periksa ketegangan V-belt, kencangkan kembali jika perlu</li><li>Menguras air dari filter bahan bakar tambahan</li><li>Cek Klem selang air, sambungan pipa dan baut untuk keamanan, kencangankan kembali jika perlu</li><li>Bersihkan pra-filter Bahan Bakar </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:02:21', 20220101, 16, '2022-01-01', 2),
(29, '2022-01-01', 'P.201010101000/200JAM', 3, 2, 2, 2, 8, 8, 0, 'Main Diesel Generator', 'Pengecekan komponen dan pemeriksaan ketegangan V-belt Main Diesel Generator', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek eksterior mesin dari kehilangan oli dan cairan pendingin</li><li>Cek level Coolant dan level oli Engin dan cek konsentrasi agen anti korosi</li><li>Cek sistem alarm Engine untuk fasilitas berhenti darurat dan cek Fungsi instrumen</li><li>Cek Pemanasan awal, fungsi, pengaturan Coolant</li><li>Cek selang Pendingin untuk kebocoran dan porositas</li><li>Cek saluran bahan bakar untuk kebocoran</li><li>Periksa ketegangan V-belt, kencangkan kembali jika perlu V-belt</li><li>Cek menguras air dari filter bahan bakar tambahan </li><li>Cek kondisi impeller pompa air yang belum diolah (jika terpasang)</li><li>.Cek klem selang air, sambungan pipa dan baut untuk keamanan, pengencangan kembali jika perlu</li><li>Mengganti oli Mesin dan kartrid oli mesin, bersihkan pra-filter Bahan Bakar </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:01:59', 20220101, 19, '2022-01-01', 2),
(30, '2022-01-01', 'P.201010101000/400JAM', 3, 2, 2, 2, 8, 8, 0, 'Main Diesel Generator', 'Pengecekan komponen dan membersihkan pra-filter Bahan Bakar', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek Eksterior mesin dari kehilangan oli dan cairan pendingin</li><li>Cek level Coolant dan level oli Engine</li><li>Cek Konsentrasi agen anti korosi</li><li>Cek sistem alarm Engine untuk fasilitas berhenti darurat dan fungsi instrumen</li><li>Cek Pemanasan awal, fungsi, pengaturan Coolant</li><li>Cek selang Pendingin untuk kebocoran dan porositas</li><li>Cek saluran bahan bakar untuk kebocoran</li><li>Periksa ketegangan V-belt, kencangkan kembali jika perlu V-belt</li><li>Kuras air dari filter bahan bakar tambahan, bersihkan pra-filter Bahan Bakar</li><li>Cek dan kencangkan baut kepala silinder, atur celah katup</li><li>Cek kondisi baling-baling pompa air</li><li>Cek Klem selang air, sambungan pipa dan baut untuk keamanan, pengencangan kembali jika perlu</li><li>Penggantian oli mesin, kartrid oli mesin, dan filter udara tergantung pada kondisi pengoperasian </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:02:14', 20220101, 22, '2022-01-01', 2),
(31, '2022-01-01', 'P.201010101000/T', 3, 2, 2, 2, 8, 8, 0, 'Main Diesel Generator', 'Pengecekan komponen dan membersihkan pra-filter Bahan Bakar', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek Eksterior mesin dari kehilangan oli dan cairan pendingin</li><li>Cek level Coolant dan level oli Engine </li><li>Cek Konsentrasi agen anti korosi</li><li>Cek sistem alarm Engine untuk fasilitas berhenti darurat dan fungsi instrumen</li><li>Cek Pemanasan awal, fungsi, pengaturan Coolant</li><li>Cek selang Pendingin untuk kebocoran dan porositas</li><li>Cek saluran bahan bakar untuk kebocoran</li><li>Periksa ketegangan V-belt, kencangkan kembali jika perlu V-belt </li><li>Menguras air dari filter bahan bakar tambahan bersihkan pra-filter Bahan Bakar </li><li>Cek dan kencangkan sekrup tutup kepala soket, lakukan penyetelan celah katup</li><li>Cek Klem selang air, sambungan pipa dan baut untuk keamanan, pengencangan kembali jika perlu</li><li>Penggantian oli mesin, kartrid oli mesin, dan filter udara tergantung pada kondisi pengoperasian </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:02:28', 20220101, 9, '2022-01-01', 1),
(32, '2022-01-01', 'P.201010101000/2T', 3, 2, 2, 2, 8, 8, 0, 'Main Diesel Generator', 'Pengecekan komponen Main Diesel Generator', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek Eksterior mesin dari kehilangan oli dan cairan pendingin</li><li>Cek level Coolant dan level oli Engine</li><li>Cek Konsentrasi agen anti korosi</li><li>Cek sistem alarm Engine untuk fasilitas berhenti darurat dan fungsi instrumen</li><li>Cek Pemanasan awal, fungsi, pengaturan Coolant</li><li>Cek selang Pendingin untuk kebocoran dan porositas</li><li>Cek saluran bahan bakar untuk kebocoran</li><li>Periksa ketegangan V-belt, kencangkan kembali jika perlu V-belt</li><li>Menguras air dari filter bahan bakar tambahan</li><li>Cek Nozel Injeksi, ganti bila perlu. Menyetel celah katup</li><li>Cek Klem selang air, sambungan pipa dan baut untuk keamanan, pengencangan kembali jika perlu</li><li>Penggantian oli mesin, kartrid oli mesin, filter bahan bakar, filter udara servis dan kedua tutup katup pada tangki ekspansi</li><li>Pra-filter Bahan Bakar Bersih </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:02:06', 20220101, 10, '2022-01-01', 1),
(33, '2022-01-01', 'P.201010102000/H', 3, 2, 2, 2, 8, 9, 0, 'Emergency Diesel Generator', 'Memeriksa level oli, level cairan pendingin dan level bahan bakar', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa level oli </li><li>Membaca indikator vakum Pembersih udara </li><li>Memeriksa level cairan pendingin </li><li>Memeriksa level bahan bakar </li><li>Memeriksa kebocoran </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:15', 20220101, 1, '2022-01-01', 1),
(34, '2022-01-01', 'P.201010102000/500JAM', 3, 2, 2, 2, 8, 9, 0, 'Emergency Diesel Generator', 'Pemeriksaan, pembersihan komponen dan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Mengganti oli dan membersihkan pembersih oli sentrifugal </li><li>Memperbarui filter oli </li><li>Membaca indikator vakum Pembersih udara </li><li>Memeriksa level cairan pendingin </li><li>Memeriksa anoda korban </li><li>Memeriksa impeller pompa air laut </li><li>Menguras air yang memisahkan prefilter </li><li>Memeriksa kebocoran </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:02:53', 20220101, 23, '2022-01-01', 2),
(35, '2022-01-01', 'P.201010102000/1000JAM', 3, 2, 2, 2, 8, 9, 0, 'Emergency Diesel Generator', 'Penggantian oli dan filter oli,  memeriksa  level cairan pendingin dan impeller pompa air laut', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Mengganti oli dan membersihkan pembersih oli sentrifugal</li><li>Memperbarui filter oli </li><li>Membaca indikator vakum Pembersih udara</li><li>Memeriksa level cairan pendingin </li><li>Memeriksa anoda korban </li><li>Memeriksa impeller pompa air laut </li><li>Menguras air yang memisahkan prefilter </li><li>Memperbarui filter bahan bakar </li><li>Memeriksa sabuk penggerak </li><li>Memeriksa kebocoran </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:02:37', 20220101, 24, '2022-01-01', 2),
(36, '2022-01-01', 'P.201010102000/2000JAM', 3, 2, 2, 2, 8, 9, 0, 'Emergency Diesel Generator', 'Pemeriksaan komponen dan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Mengganti oli dan membersihkan pembersih oli sentrifugal</li><li>Memperbarui filter oli </li><li>Membaca indikator vakum Pembersih udara </li><li>Memperbarui elemen filter, kartrid pengaman dan filter udara </li><li>Memeriksa level cairan pendingin </li><li>Memeriksa antibeku pendingin dan perlindungan korosi </li><li>Memeriksa anoda korban\r\n8.Memeriksa impeller pompa air laut </li><li>Menguras air yang memisahkan prefilter </li><li>Memperbarui filter bahan bakar </li><li>Memeriksa sabuk penggerak </li><li>Memeriksa kebocoran dan menyetel celah katup dan unit injektor </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:02:44', 20220101, 26, '2022-01-01', 2),
(37, '2022-01-01', 'P.201010102000/6000JAM', 3, 2, 2, 2, 8, 9, 0, 'Emergency Diesel Generator', 'Pemeriksaan komponen,  penggantian oli dan penggantian cairan pendingin', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Mengganti oli dan membersihkan pembersih oli sentrifugal </li><li>Memperbarui filter oli </li><li>Membaca indikator vakum Pembersih udara </li><li>Memperbarui elemen filter, kartrid pengaman dan filter udara </li><li>Memeriksa level cairan pendingin </li><li>Memeriksa antibeku pendingin dan perlindungan korosi </li><li>Memeriksa anoda korban </li><li>Memeriksa impeller pompa air laut </li><li>Mengganti cairan pendingin dan membersihkan sistem pendingin </li><li>Menguras air yang memisahkan prefilter </li><li>Memperbarui filter bahan bakar </li><li>Memeriksa sabuk penggerak, kebocoran, menyetel celah katup dan unit injektor </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:07', 20220101, 29, '2022-01-01', 2),
(38, '2022-01-01', 'P.201010102000/T', 3, 2, 2, 2, 8, 9, 0, 'Emergency Diesel Generator', 'Penggantian oli dan filter oli dan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Mengganti oli dan membersihkan pembersih oli sentrifugal </li><li>Memperbarui filter oli </li><li>Memeriksa antibeku pendingin dan perlindungan korosi </li><li>Memeriksa anoda korban </li><li>Memeriksa impeller pompa air laut </li><li>Memeriksa sabuk penggerak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:23', 20220101, 9, '2022-01-01', 1),
(39, '2022-01-01', 'P.201010102000/5T', 3, 2, 2, 2, 8, 9, 0, 'Emergency Diesel Generator', 'Penggantian elemen filter, kartrid pengaman, filter udara dan cairan pendingin', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memperbarui elemen filter </li><li>Memperbarui kartrid pengaman </li><li>Memperbarui filter udara dengan elemen yang tidak dapat diperbarui </li><li>Mengganti cairan pendingin dan membersihkan sistem pendingin </li><li>Memperbarui filter bahan bakar </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:00', 20220101, 13, '2022-01-01', 1),
(40, '2022-01-01', 'P.202010101000/B', 3, 3, 3, 3, 8, 6, 0, 'MSB ( Main Switch Board)', 'Tes kebocoran ground CB (Circuit Breaker)', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Penggunaan tombol test untuk mengecek kebocoran groun CB (Circuit Breaker) </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:45', 20220101, 4, '2022-01-01', 1),
(41, '2022-01-01', 'P.202010101000/2T', 3, 3, 3, 3, 8, 6, 0, 'MSB ( Main Switch Board)', 'Lakukan pemeriksaan MCB', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lepas peredam percikan api ( arc chutes ) </li><li>Tutup peredam percikan api ( arc chutes ) dan periksa apakah bagian dalam kontak terbakar/rusak</li><li>Periksa kabel untuk setiap tanda-tanda kerusakan seperti isolasi kabel lecet, rusak , pecahan atau karatan </li><li>Pengetesan kemampuan (bekerjanya) sirkuit breaker </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:30', 20220101, 10, '2022-01-01', 1),
(42, '2022-01-01', 'P.202010101000/5T', 3, 3, 3, 3, 8, 6, 0, 'MSB ( Main Switch Board)', 'Periksa sambungan-sambungan ground', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Tes sambungan ground dari seluruh papan distribusi (distribution panels) dengan alat ukur </li><li>Cek kemungkinan adanya bintik-bintik panas pada rangkaian circuit breaker </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:38', 20220101, 13, '2022-01-01', 1),
(43, '2022-01-01', 'P.202010102000/2T', 3, 3, 3, 3, 8, 9, 0, 'ESB (Emergency Switch Board)', 'Periksa permukaan kontak- kontak, mekanikal kontak CB', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Kerusakan/terbakarnya bagian dalam\r\nPengetesan kemampuan (bekerjanya) sirkuit breaker </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:03:53', 20220101, 10, '2022-01-01', 1),
(44, '2022-01-01', 'P.202010102000/5T', 3, 3, 3, 3, 8, 9, 0, 'ESB (Emergency Switch Board)', 'Periksa sambungan-sambungan ground, Periksa bekerjanya rangkaian-rangkaian', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Sambungan ground dari seluruh papan distribusi (distribution panels) harus ditest dengan alat ukur\r\nCek kemungkinan adanya bintik-bintik panas pada rangkaian circuit breaker </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:00', 20220101, 13, '2022-01-01', 1),
(45, '2022-01-01', 'P.202010103000/2T', 3, 3, 3, 3, 8, 11, 0, 'Shore Connection', 'Lakukan pemeriksaan Shore Connection', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek kontak-kontaknya msaih bekerja sesuai fungsinya atau tidak </li><li>Bila terminal kontak korosi, bersihkan dengan clear kontak </li><li>Periksa fungsinya MCB 3 phase saat ON dan OFF </li><li>Periksa kemungkinan adanya bintik-bintik panas atau terbakarya circuit breaker</li><li>Periksa Lampu Indikator dan alat ukur pada panel pastikan berfungsi dengan baik </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:07', 20220101, 10, '2022-01-01', 1),
(46, '2022-01-01', 'P.202010104000/3B', 3, 3, 3, 3, 8, 12, 0, 'Lampu Penerangan', 'Periksa secara visual & Tes lampu dengan beban', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek lampu secara visual dari tanda tanda kerusakan</li><li>Lepaskan dari aliran listrik dan cabut/lepas lampu </li><li>Sambung kembali aliran listrik dan gunakan multimeter untuk mengecek aliran listrik pada tempat lampu </li><li>Lampu hanya dapat dicek dengan menggunakan multimeter untuk keawetan kawat filament </li><li>Lepas kembali aliran listrik dan kembalikan lampu dengan hati-hati </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:16', 20220101, 6, '2022-01-01', 1),
(47, '2022-01-01', 'P.202010105000/T', 3, 3, 3, 3, 8, 13, 0, 'Battery Charger', 'Periksa sambungan kabel ke batterai dan bersihkan Battery Charger', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa sambungan kabel ke batterai dari kerusakan dan korosi pada terminal charger</li><li>Bersihkan charger dari debu dan kotoran agar pengisi daya tetap bersih dan kering </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:23', 20220101, 9, '2022-01-01', 1),
(48, '2022-01-01', 'P.202010106000/3B', 3, 3, 3, 3, 8, 14, 0, 'Battery', 'Periksa Kondisi dan sambungan-sambungan pada batterai', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa terminal, sekrup, klem dan kabel dari kerusakan atau sambungan yang kendor. Ini harus bersih, kencang dan bebas dari korosi</li><li>Pastikan bagian atas baterai bersih, kering, bebas dari kotoran dan debu</li><li>Cek voltase batterai, Jika voltase baterai berbeda dari rata-rata yang dikeluarkan lebih besar dari 0,49 V atau kurang dari 0,24 V segera service</li><li>Oleskan lapisan tipis gemuk suhu tinggi ke tiang dan sambungan kabel untuk perlindungan tambahan</li><li>Periksa kotak baterai untuk tanda-tanda kerusakan fisik, ganti jika sudah terjadi perubahan fisik  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:31', 20220101, 6, '2022-01-01', 1),
(49, '2022-01-01', 'P.202010107000/T', 3, 3, 3, 3, 8, 1, 0, 'Tranformer', 'Lakukan pemeriksaan Tranformer', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa apakah shell transformator lengkap dan koneksi yang ketat. Pastikan casingnya tidak rusak</li><li>Periksa apakah sekeliling trafo bersih dan bebas air</li><li>Periksa peralatan ventilasi di ruang distribusi atau kabinet</li><li>Pastikan tidak ada fenomena overheating di setiap bagian transformator</li><li>Periksa apakah kawat trafo kokoh, posisinya normal, dan jarak isolasi di sekitar timbal berubah</li><li>Pastikan sambungan baut di trafo erat, dan trafo tidak memiliki gangguan abnormal</li><li>Bagian sambungan listrik pada casing dan papan pengkabel harus rapat dan bebas dari panas berlebih</li><li>Periksa apakah ada kerusakan pada trafo, hilangkan kotoran dan debu dari cincin. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:39', 20220101, 9, '2022-01-01', 1),
(50, '2022-01-01', 'P.301010101000/1000JAM', 4, 4, 4, 4, 8, 15, 0, 'Emergency Air Compressor', 'Periksa Emergency Air Compressor dan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa dan merapihkan koneksi kabel</li><li>Penggantian kartrid filter udara </li><li>Periksa katup dan ganti Oli</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:47', 20220101, 24, '2022-01-01', 2),
(51, '2022-01-01', 'P.301010101000/2000JAM', 4, 4, 4, 4, 8, 15, 0, 'Emergency Air Compressor', 'Periksa Emergency Air Compressor dan penggantian oli dan katup', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li><span style=\"font-size: 1rem;\">Memeriksa koneksi yang kacau</span></li><li>Penggantian kartrid filter udara </li><li>Ganti oli dan ganti katup </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:04:55', 20220101, 26, '2022-01-01', 2),
(52, '2022-01-01', 'P.301010101000/4000JAM', 4, 4, 4, 4, 8, 15, 0, 'Emergency Air Compressor', 'Pemeriksaan dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa dan merapihkan koneksi kabel </li><li>Penggantian kartrid filter udara </li><li>Ganti oli dan ganti katup </li><li>Ganti ring piston </li><li>Ganti pin gudgeon dan bantalan pin gudgeon </li><li>Memeriksa piston dan silinder </li><li>Memeriksa kopling, memeriksa pemisah dan memeriksa katup pengaman </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:05:10', 20220101, 28, '2022-01-01', 2),
(53, '2022-01-01', 'P.301010101000/8000JAM', 4, 4, 4, 4, 8, 15, 0, 'Emergency Air Compressor', 'Pemeriksaan dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memeriksa dan merapihkan koneksi kabel </li><li>Penggantian kartrid filter udara </li><li>Ganti oli dan ganti katup dan ring piston</li><li>Ganti pin gudgeon dan bantalan pin gudgeon </li><li>Memeriksa piston dan silinder </li><li>Memeriksa bantalan penggerak, bantalan batang penghubung </li><li>Memeriksa kopling </li><li>Ganti sisipan fleksibel kopling </li><li>Memeriksa pemisah\r\n1</li><li>Ganti segel poros</li><li>Checking safety valves </li><li>Major overhaul </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:05:27', 20220101, 30, '2022-01-01', 2),
(54, '2022-01-01', 'P.301010102000/H', 4, 4, 4, 4, 8, 15, 0, 'Main Compressor', 'Kuras kondensat dan Pemeriksaan pembuangan valve', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Kuras kondensat dari penerima udara</li><li>Pemeriksaan pembuangan valve/separator menggunakan manual drain valve. (Tidak berlaku dalam kasus pengurasan otomatis). </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:07:00', 20220101, 1, '2022-01-01', 1),
(55, '2022-01-01', 'P.301010102000/250JAM', 4, 4, 4, 4, 8, 15, 0, 'Main Compressor', 'Periksa level oli, katup kompresi dan ganti saringan/filter udara', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa level oli</li><li>Kuras minyak dan isi ulang dengan minyak baru</li><li>Ganti saringan/filter udara</li><li>Periksa katup masuk dan katup kompresi. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:06:40', 20220101, 20, '2022-01-01', 2);
INSERT INTO `kartu_pemeliharaan` (`id`, `tanggal`, `kode_pemeliharaan`, `id_komponen_pokok`, `id_komponen_sub_pokok`, `id_sistem`, `id_sub_sistem`, `id_pelaksana`, `id_lokasi`, `id_kapal`, `komponen`, `uraian_pemeliharaan`, `tindakan_pengamanan`, `prosedur`, `alat_kerja`, `jo`, `created_at`, `updated_at`, `user_create`, `id_periode`, `tgl_mulai`, `id_jenis_perawatan`) VALUES
(56, '2022-01-01', 'P.301010102000/1500JAM', 4, 4, 4, 4, 8, 15, 0, 'Main Compressor', 'Pemeriksaan dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Ganti katup intake dan katup kompresi</li><li>Ganti gasket dan ganti filter pemasukan udara</li><li>Periksa sumbat oli dan sumbat pembuangan oli</li><li>Periksa rakitan koil pendingin, periksa ring piston dan periksa kopling</li><li>Periksa kepala silinder, kuras minyak dan isi ulang dengan minyak baru. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:05:42', 20220101, 25, '2022-01-01', 2),
(57, '2022-01-01', 'P.301010102000/3000JAM', 4, 4, 4, 4, 8, 15, 0, 'Main Compressor', 'Pemeriksaan, pembersihan dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li><span style=\"font-size: 1rem;\">Periksa kopling, periksa piston dan silinder</span><br></li><li>Ganti rakitan koil pendingin, ganti katup intake dan katup kompresi</li><li>Ganti gasket dan filter pemasukan udara</li><li>Ganti kepala silinder, ganti sumbat oli dan sumbat pembuangan oli</li><li>Ganti ring piston, Kuras minyak dan isi ulang dengan minyak baru</li><li>Bersihkan kompresor. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:06:50', 20220101, 27, '2022-01-01', 2),
(58, '2022-01-01', 'P.301010102000/T', 4, 4, 4, 4, 8, 15, 0, 'Main Compressor', 'Lakukan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Kuras minyak dan isi ulang dengan minyak baru. </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:07:11', 20220101, 9, '2022-01-01', 1),
(59, '2022-01-01', 'P.301010103000/H', 4, 4, 4, 4, 8, 16, 0, 'Air Conditioning System', 'Pengecekan secara visual pada sistem dan cek tekanan freon', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan inspeksi secara visual untuk memastikan unit berjalan dengan lancar</li><li>Cek dan catat tekanan pada tekanan tinggi (High Pressure) dan tekanan rendah (Low Pressure). 60-65 psi pada indikator tekanan rendah/low pressure dan 260-270 psi pada indikator tekanan tinggi/ high pressure pada saat chiller berjalan normal. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:25:36', 20220101, 1, '2022-01-01', 1),
(60, '2022-01-01', 'P.301010103000/B', 4, 4, 4, 4, 8, 16, 0, 'Air Conditioning System', 'Lakukan pengecekan dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek kondisi dan kebersihan air pada evaporator, termasuk kemungkinan adanya kontaminasi zat-zat lain. Periksa juga kadar keasaman air</li><li>Periksa kemungkinan adanya kebocoran (Pipa sambungan di kompresor, pompa oli kompresor, dan katup-katup)</li><li>Cek temperature pada motor kompresor (periksa buku manual kompresor)</li><li>Lakukan pembersihan fin koil condenser minimal 1 bulan sekali, gunakan mesin penyemprot air dengan tekanan sedang, perhatikan arah pancaran air agar tidak terkena kabel atau kotak panel kontrol</li><li>Periksa semua insulasi pipa, segera perbaiki jika ada yang kendor atau terkelupas</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 11:07:21', 20220101, 4, '2022-01-01', 1),
(61, '2022-01-01', 'P.301010103000/T', 4, 4, 4, 4, 8, 16, 0, 'Air Conditioning System', 'Lakukan pengecekan dan bersihkan tabung evaporator', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan pembersihan tabung evaporator, periksa kemungkinan adanya karat dan korosi</li><li>Cek semua koneksi kabel yang terhubung ke kotak panel kontrol, kencangkan bila ada yang kendor / terlepas</li><li>Bersihkan kontak poin pada kontaktor, bersihkan dari debu dan kotoran</li><li>Cek level oli pada kompresor (lihat buku manual kompresor) isi oli kompresor bila kurang dari batas minimal</li><li>Cek semua katup, filter drier, lakukan tes bocor, ganti bila ada komponen yang rusak</li><li>Cek baut-baut pengikat (kompresor, evaporator, dll) kencangkan bila ada yang kendor, ganti bila ada baut / mur yang berkarat. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:26:32', 20220101, 9, '2022-01-01', 1),
(62, '2022-01-01', 'P.301010104000/T', 4, 4, 4, 4, 8, 17, 0, 'Natural Ventilation System', 'Periksa dan bersihkan natural ventilation system', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan ventilasi dari kotoran dan debu yang menempel</li><li>Periksa koneksi ventilator harus dalam kondisi kencang dan kuat </li><li>Periksa ventilator dari kerusakan fisik </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:27:08', 20220101, 9, '2022-01-01', 1),
(63, '2022-01-01', 'P.301010105000/M', 4, 4, 4, 4, 8, 18, 0, 'Mechanical Ventilation System', 'Lakukan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa komutator dan sikat </li><li>Periksa sakelar starter, sekering, dan kontrol lainnya. Kencangkan sambungan yang longgar</li><li>Lihat mesin pada kecepatan putaran normal berputar normal atau tidak</li><li>Periksa secara teratur getaran untuk memperkirakan kegagalan lebih awal seperti kerusakan  bearing, ketidaksesuaian sambungan, ketidakseimbangan, kelonggaran fondasi, dll </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:28:51', 20220101, 2, '2022-01-01', 1),
(64, '2022-01-01', 'P.301010105000/6B', 4, 4, 4, 4, 8, 18, 0, 'Mechanical Ventilation System', 'Pemeriksaan dan pembersihan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa Kondisi Motor dan lumasi Bantalan (Bearings) dengan minyak, periksa kualitas minyak jika perlu diganti </li><li>Periksa dan Pastikan bantalan cukup terlindungi dari kontaminasi </li><li>Bersihkan Fan dan komponen system yang rentan terkontaminasi secara menyeluruh </li><li>Periksa kebocoran saluran yang dapat menyebabkan kehilangan energy dan performa system yang buruk </li><li>Periksa kualitas pasokan daya yang cukup ke penggerak motor </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:28:05', 20220101, 8, '2022-01-01', 1),
(65, '2022-01-01', 'P.301010105000/T', 4, 4, 4, 4, 8, 18, 0, 'Mechanical Ventilation System', 'Pembersihan komponen dan uji isolasi dengan megohmmeter', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan dan perbarui grease(gemuk) di rumah bantalan </li><li>Bersihkan kotoran magnet yang mungkin menempel pada kutub </li><li>Periksa jarak bebas antara poros dan kotak dari motor bantalan lengan agar bantalan tidak cepat aus </li><li>Bersihkan slot undercut pada komutator dan periksa komutator untuk kelancaran </li><li>Periksa hubungan antara komutator dan kumparan jangkar </li><li>Uji isolasi dengan megohmmeter </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:29:44', 20220101, 9, '2022-01-01', 1),
(66, '2022-01-01', 'P.301010106000/B', 4, 4, 4, 4, 8, 19, 0, 'Refrigerating Plant', 'Lakukan pemeriksaan dan pembersihan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa kondisi pompa sirkulasi Chiller bekerja dengan baik </li><li>Pastikan compressor chiller berjalan normal, periksa kondisi panel chiller dan pastikan tidak ada trouble pada chiller </li><li>Periksa dan catat Low Pressure dan High Pressure pada pressure gauge, untuk low pressure 35  50 psi dan high pressure antara 170  300 psi </li><li>Bersihkan chiller dari sampah-sampah/kotoran yang berada di sekitar area mesin chiller </li><li>Bersihkan panel listrik Chiller dengan hati-hati menggunakan selang angin. Semprotkan angin dengan jarak kurang lebih 30cm </li><li>Cek arus compressor pada Panel listrik Chiller, Gunakan tang ampere pada salah satu kabel sumber compressor. Catat hasilnya</li><li>Ukur temperature condensor. Untuk mengukur temperature condenser dapat menggunakan raytec. Catat hasilnya</li><li>Periksa expantion valve Chiller, Cek pipanya beku atau tidak. Bila terjadi kebekuan, maka setting ulang piston </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:32:48', 20220101, 4, '2022-01-01', 1),
(67, '2022-01-01', 'P.301010106000/4B', 4, 4, 4, 4, 8, 19, 0, 'Refrigerating Plant', 'Pembersihan komponen dan pengecekan tekanan freon', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek tekanan Freon menggunakan manifold gauge, Pastikan tekanan freon tidak berlebih ataupun rendah</li><li>Bersihkan Condensor Chiller dari kerak yang menempel, Kotornya condenser ini juga dapat di analisa melalui tingginya angka high pressure</li><li>Lakukan pengecekan pipa-pipa pendingin </li><li>Setting ulang temperature pada temperature control. Sesuaikan standar temperature dengan kebutuhan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:31:36', 20220101, 7, '2022-01-01', 1),
(68, '2022-01-01', 'P.301010107000/3B', 4, 4, 4, 4, 8, 1, 0, 'Reverse Osmosis', 'Periksa dan bersihkan pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa dan Bersihkan Layar dan Rumah pompa </li><li>Bersihkan bagian dalam tabung bening </li><li>Ganti elemen Filter dan ganti seal Booster pump Sesuai kebutuhan </li><li>Ganti Oli Crankcase Pompa tekanan tinggi </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:35:02', 20220101, 6, '2022-01-01', 1),
(69, '2022-01-01', 'P.301010107000/T', 4, 4, 4, 4, 8, 1, 0, 'Reverse Osmosis', 'Lakukan penggantian membran dan probe jika diperlukan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Ganti Membran Ketika produksi atau penolakan Salinitas berkurang 20% Atau tekanan umpan meningkat 20%\r\n2.Ganti probe Setiap Tahun </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:35:32', 20220101, 9, '2022-01-01', 1),
(70, '2022-01-01', 'P.301010108000/B', 4, 4, 4, 4, 8, 1, 0, 'OWS (Oil water separator)', 'Lakukan perawatan dan pembersihan OWS', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan pembilasan pada Oil Water Separator dengan menjalankan pompa Bilge dan buka keran By-Pass agar bersikulasi ke Bilge Tank</li><li>Bersihkan endapan yang memasuki OWS dengan pencucian uap atau mebersihkan dan mengganti lapisan dalam yang rusak </li><li>Bersihkan kotoran minyak yang tersisa pada kedua tabung separator secara berkala </li><li>Lakukan Perawatan oil content monitor dan solenoid valve, dengan melaksanakan SOP pembersihan atau flushing pipa  saluran </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:36:54', 20220101, 4, '2022-01-01', 1),
(71, '2022-01-01', 'P.301010108000/6B', 4, 4, 4, 4, 8, 1, 0, 'OWS (Oil water separator)', 'Perawatan saringan dan filter', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Perawatan pada saringan-saringan dan filter harus dalam keadaan bersih sebelum dan sesudah pemakaian</li><li>Lakukan penggantian Multi Level Pararel Jika aus atau rusak </li><li>Lakukan penggantian Selenoid Valve Jika aus atau rusak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:36:10', 20220101, 8, '2022-01-01', 1),
(72, '2022-01-01', 'P.301010108000/T', 4, 4, 4, 4, 8, 1, 0, 'OWS (Oil water separator)', 'Lakukan penggantian komponen yang aus', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan penggantian komponen Saringan Bentuk T Jika aus atau rusak </li><li>Lakukan penggantian komponen Non Return Valve Jika aus atau rusak </li><li>Lakukan penggantian komponen Katup Globe Jika aus atau rusak </li><li>Lakukan penggantian komponen Saringan Bentuk Y Jika aus atau rusak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:37:30', 20220101, 9, '2022-01-01', 1),
(73, '2022-01-01', 'P.301010109000/H', 4, 4, 4, 4, 8, 15, 0, 'Sewage Treatment', 'Reset alarm dan  pengecekan bagian-bagian Sewage Treatment Plan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Reset alarm, pastikan lampu common alarm tidak menyala</li><li>Cek supply udara dari compressor</li><li>Cek tangki, pipa dan pompa dari kebocoran</li><li>Cek UV-Sterilizer saat operasional, lampu ungu/biru redup menandakan lampu UV lamp harus diganti. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:44:42', 20220101, 1, '2022-01-01', 1),
(74, '2022-01-01', 'P.301010109000/M', 4, 4, 4, 4, 8, 15, 0, 'Sewage Treatment', 'Pembersihan Sewage Treatment Plan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Alirkan udara secara penuh ke dalam tangki bioreactor dengan cara menutup semua inlet valve supply udara dan membuka 1 valve supply udara secara bergantian selama  30 detik. Dilakukan 2 kali</li><li>Bersihkan Grease trap, buka vlave bypass dan tutup inlet serta outlet valve, aliran bypass akan mengalir menuju tangki sludge tank. Buka cover grease trap dan bersihkan kotoran yang mengendap didalam grease trap </li><li>De-sludge (pengambilan sludge) pada bioreactor tank dan settling tank. yang dimaksud De-sludge adalah sama dengan cleaning lumpur didalam tangki dengan menggunakan pompa discharge dengan cara menutup inlet discharge pada tangki dan membuka inlet tangki </li><li>Setelah valve sudah tersetting maka langkah selanjutnya adalah menghidupkan pompa discharge secara manual selama  1 menit atau menghisap air sebanyak  20 cm. sehingga sludge pada tangki 2 terbuang ke overboard </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:46:54', 20220101, 2, '2022-01-01', 1),
(75, '2022-01-01', 'P.301010109000/B', 4, 4, 4, 4, 8, 15, 0, 'Sewage Treatment', 'Pembersihan dan  pengecekan bagian-bagian Sewage Treatment Plan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek fungsi semua alarm&nbsp;</li><li>Control jam putar dari pada lampu UV-Sterilizer (perhitungan mundur, dari 8000 - 0 jp)</li><li>Cek kondisi quartz sleeve (rumah lampu UV)</li><li>Cek filter udara compressor, ganti/bersihkan jika perlu</li><li>Kosongkan dan bersihkan grease trap, isi dengan fresh water</li><li>Cek ukuran baling-baling/sudu-sudu compressor, isi buku jurnal data ukuran vane dan ganti bila sudah batas limit. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:41:33', 20220101, 4, '2022-01-01', 1),
(76, '2022-01-01', 'P.301010109000/T', 4, 4, 4, 4, 8, 15, 0, 'Sewage Treatment', 'Pembersihan dan  pengecekan Sewage Treatment Plan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Matikan supply udara dari compressor</li><li>De-sludge bioreactor, inlet dan settling tank, buka cover atas tangki dan isi dengan air tawar lalu flushing dan isi kembali dengan air tawar serta adakan pemeriksaan matrik. (normal masa pakai 8-10 th)</li><li>Grease trap, laksanakan pembersihan secara total dan isi kembali dengan air tawar</li><li>Cek vane/baling/sudu-sudu compressor, ganti jika sudah wear limit</li><li>Bersihkan pipa pada sludge return system, isi tangki 3 dengan air kemudian nyalakan sludge return system by manual mode</li><li>Start compressor dan cek system aerasi/angin-angin</li><li>Cek fungsi solenoid valve</li><li>Ganti lampu dan o-ring (jika diperlukan) pada UV-Sterilized jika sudah mencapai 9000 jp. Bersihkan/ganti quartz slevee jika diperlukan</li><li>Tambahkan bakteri sesuai dosis yang diijinkan dan tutup inspection hatch.</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:49:55', 20220101, 9, '2022-01-01', 1),
(77, '2022-01-01', 'P.301010110000/H', 4, 4, 4, 4, 8, 20, 0, 'Incinerator', 'Lakukan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa ruang bakar, bersihkan semua abu dan terak setelah pembakaran selesai</li><li><span style=\"font-size: 1rem;\">Periksa saluran masuk udara ruang bakar di bagian bawah harus selalu dibersihkan</span></li><li><span style=\"font-size: 1rem;\">Periksa tekanan minyak diesel burner. Pembacaan normal 1,6 MPa</span></li><li><span style=\"font-size: 1rem;\">Periksa tekanan minyak lumpur pompa dosis. Pembacaan normal 0,05 MPa</span></li><li><span style=\"font-size: 1rem;\">Periksa dan bersihkan nozel lumpur setelah pembakaran selesai.</span></li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:02:01', 20220101, 1, '2022-01-01', 1),
(78, '2022-01-01', 'P.301010110000/M', 4, 4, 4, 4, 8, 20, 0, 'Incinerator', 'Pembersihan dan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li><span style=\"font-size: 1rem;\">Bersihkan resistor photo pada burner</span><br></li><li>Periksa apakah saluran masuk udara pembakaran dan saluran masuk udara pendingin bebas dari penghalang. Bersihkan jika perlu</li><li>Periksa pembakar minyak diesel</li><li>Periksa kompor minyak lumpur</li><li>Berikan minyak pelumas pada engsel pintu</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:01:46', 20220101, 2, '2022-01-01', 1),
(79, '2022-01-01', 'P.301010110000/B', 4, 4, 4, 4, 8, 20, 0, 'Incinerator', 'Lakukan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Ruang incinerator harus selalu dalam keadaan bersih</li><li>Periksa kondisi refraktori</li><li>Periksa termokopel visual untuk ruang bakar. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 06:58:49', 20220101, 4, '2022-01-01', 1),
(81, '2022-01-01', 'P.301010111000/4000JAM', 4, 4, 4, 4, 8, 1, 0, 'FO Separator', 'Lakukan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Lakukan penggantian oli setiap 4000 jam atau sekurang-kurangnya sekali setiap tahun </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:06:07', 20220101, 28, '2022-01-01', 2),
(82, '2022-01-01', 'P.301010111000/12000JAM', 4, 4, 4, 4, 8, 1, 0, 'FO Separator', 'Lakukan Overhaul separator bowl', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan overhaul separator bowl, inlet/outlet dan perangkat operasi</li><li>Perbaharui Segel, bantalan, blok gesekan dan flat belt di separator  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:03:26', 20220101, 31, '2022-01-01', 2),
(83, '2022-01-01', 'P.301010111000/24000JAM', 4, 4, 4, 4, 8, 1, 0, 'FO Separator', 'Lakukan overhaul dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan overhaul motor maksimal 36 bulan atau 24000 Jam operasi </li><li>Lakukan pengantian bantalan, kipas, segel dan mesin cuci untuk motor </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:04:50', 20220101, 32, '2022-01-01', 2),
(84, '2022-01-01', 'P.301010111000/3T', 4, 4, 4, 4, 8, 1, 0, 'FO Separator', 'Periksa semua bagian FO Separator', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Tempatkan bagian pemisah pada permukaan yang bersih dan lembut seperti palet</li><li>Periksa dan bersihkan bagian pemisah yang dibongkar sesuai dengan perawatannya</li><li>Pasang semua suku cadang yang dikirimkan ke dalam kit servis sambil merakit separator</li><li>Saat pemisah dipasang, lakukan pemeriksaan akhir </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:05:45', 20220101, 11, '2022-01-01', 1),
(85, '2022-01-01', 'P.301010112000/3B', 4, 4, 4, 4, 8, 1, 0, 'LO Separator', 'Lakukan overhaul separator bowl', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan overhaul separator bowl, saluran masuk dan saluran keluar setiap 3 bulan atau 2000 jam operasional</li><li>Segel dalam bowl dan gasket di perangkat inlet/outlet dan perangkat operasi diperbarui/diganti </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:07:09', 20220101, 6, '2022-01-01', 1),
(86, '2022-01-01', 'P.301010112000/T', 4, 4, 4, 4, 8, 1, 0, 'LO Separator', 'Melakukan overhaul lengkap', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Melakukan overhaul lengkap setiap 12 bulan atau 8000 jam operasi. flat belt, elemen yg bergesekan, seals dan bearings\r\ndi bagian bawah diperbarui. </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:30:02', 20220101, 9, '2022-01-01', 1),
(87, '2022-01-01', 'P.301010112000/2000JAM', 4, 4, 4, 4, 8, 1, 0, 'LO Separator', 'Lakukan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan penggantian oli interval 2000 jam dengan oli sintetik golongan D </li><li>Melakukan penggantian bantalan, segel dan penyangga di unit penggerak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 07:06:32', 20220101, 26, '2022-01-01', 2),
(88, '2022-01-01', 'P.301010112000/4000JAM', 4, 4, 4, 4, 8, 1, 0, 'LO Separator', 'Melakukan inspeksi dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Melakukan pemeriksaan separator bowl </li><li>Melakukan pemeriksaan inlet/outlet</li><li>Melakukan inspeksi sistem air operasi </li><li>Melakukan penggantian segel dan gasket</li><li>Melakukan penggantian oli pelumas </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:29:44', 20220101, 28, '2022-01-01', 2),
(89, '2022-01-01', 'P.301020101000/B', 4, 4, 5, 5, 8, 21, 0, 'Hydraulic bow anchor/ramp door / bow', 'Perawatan Hydraulic bow anchor', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Mencegah terjadinya kebocoran pada pipa-pipa hidrolik untuk ramp door dengan penggerak hidrolik</li><li>Lapisi pintu rampa dengan cat agar mencegah terjadinya korosi akibat terkontaminasi dengan air laut </li><li>Mencegah korosi pada bagian ramp door maupun motor penggerak ramp door dengan memberikan pelumas/grease </li><li>Mencegah putusnya wire rope pada saat menaikkan atau menurunkan ramp door dengan cara melumasi tali kawat</li><li>Mencegah kerusakan elektro motor akibat beban dari side ramp door yang tidak benar-benar rapat dengan dermaga pada posisi terbuka</li><li>Lumasi Engsel/hinges dengan minyak lumas grease agar tidak terjadi ke ausan pada rumah engsel dan juga korosi</li><li>Cek stopper pada ramp door dengan tujuan mengurangi hentakan pada saat pintu terkena gelombang air laut </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:32:00', 20220101, 4, '2022-01-01', 1),
(90, '2022-01-01', 'P.301020102000/M', 4, 4, 5, 5, 8, 22, 0, 'Boat Davit', 'Periksa komponen secara visual', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa semua bagian secara visual, peralatan harus dipastikan siap dioperasikan setiap saat</li><li>Periksa unit pengikat dan kencangkan kapal penyelamat dengan kuat, memastikan menurunkan kapal penyelamat dengan cepat dan lincah</li><li>Periksa tali jarak jauh dan lilitannya </li><li>Periksa tekanan oli akumulator, harus mempertahankan 18-19 Mpa </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:33:12', 20220101, 2, '2022-01-01', 1),
(91, '2022-01-01', 'P.301020102000/B', 4, 4, 5, 5, 8, 22, 0, 'Boat Davit', 'Periksa komponen secara menyeluruh', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa secara visual semua komponen, peralatan harus dipastikan siap beroperasi setiap saat</li><li>Periksa setiap titik pelumasan termasuk level oli dan kualitas oli </li><li>Periksa unit pengikat dan komponen korelasinya, kencangkan boat penyelamat dengan kokoh </li><li>Periksa kerusakan dan korosi tali kawat, lumasi tali kawat jika diperlukan.Periksa kelincahan </li><li>Periksa unit pengait yang terhubung dengan sekoci. Ganti segera jika ada retak, bengkok atau distorsi </li><li>Periksa winch pengangkat, apakah ada panas berlebih yang tidak normal, kebisingan dan kebocoran oli </li><li>Periksa level oli dan kualitas pelumas, lumasi jika diperlukan</li><li>Periksa bagian listrik, apakah semua komponen baik-baik saja </li><li>Periksa bagian hidrolik dari kebocoran oli </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:32:41', 20220101, 4, '2022-01-01', 1),
(92, '2022-01-01', 'P.301020102000/T', 4, 4, 5, 5, 8, 22, 0, 'Boat Davit', 'Pemeriksaan komponen dari kerusakan, lakukan penggantian komponen yang rusak', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa korosi, misalignment, deformasi dan kerusakan lain dari lengan davit</li><li>Periksa kerusakan tali, segera ganti setelah menemukan ketegaran, untai lepas, untai tunggal rusak 10% </li><li>Periksa dan lumasi wire rope dan semua grease nipple, tambahkan bila perlu</li><li>Periksa deformasi dan kerusakan pada cincin pengangkat</li><li>Periksa operasi winch pengangkatan. Tidak ada kebisingan dan kebocoran pada winch hidrolik </li><li>Periksa pengoperasian dan periksa tekanan pengisian nitrogen akumulator</li><li>Periksa operasi dan segel silinder hidrolik, ganti segel jika perlu</li><li>Periksa bagian kelistrikan, Periksa dan bersihkan kotak kontrol dan kotak tombol tekan remote control </li><li>Periksa isolasi dan kabel ground </li><li>Periksa level oli tangki dan kualitas oli, Ganti oli hidrolik setiap 12 atau 18 bulan. </li><li>Periksa filter, bersihkan atau Ganti jika perlu </li><li>Periksa tali kawa, ganti jika sudah berumur 5 tahun</li><li>Lakukan pengujian terjun bebas saat meluncurkan sekoci dengan muatan penuh. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:35:41', 20220101, 9, '2022-01-01', 1),
(93, '2022-01-01', 'P.301020103000/8JAM', 4, 4, 5, 5, 8, 23, 0, 'Cargo Crane', 'Pemeriksaan komponen dari kerusakan, lakukan penggan8jamian komponen yang rusak', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa apakah semua perangkat keselamatan berfungsi dengan baik</li><li>Periksa level oli hidrolik di dalam tangki </li><li>Periksa semua komponen sirkuit hidrolik untuk kemungkinan kebocoran </li><li>Periksa apakah tuas pengontrol dan pengalih oli dapat diposisikan dengan mudah, mereka tidak boleh menunjukkan tanda-tanda pemaksaan</li><li>Periksa kondisi belenggu, kait, tali kawat dan alat pengangkat lainnya </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:37:39', 20220101, 14, '2022-01-01', 2),
(94, '2022-01-01', 'P.301020103000/40JAM', 4, 4, 5, 5, 8, 23, 0, 'Cargo Crane', 'Pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa torsi pengencangan batang pengikat derek </li><li>Bersihkan filter oli yang ditempatkan di tangki oli derek, dan jika ada di bagian pompa dan selang tekanan </li><li>Pembersihan filter wire mesh pada tangki (pengembalian oli ke tangki oli) </li><li>Penggantian filter pada saluran pengiriman Bila indikator visual menjadi merah, ganti kartrid</li><li>Periksa level oli di dalam tangki dengan derek dalam posisi terlipat dan dengan cadik dimasukkan kembali sepenuhnya. Level oli tidak boleh melebihi maksimum atau lebih rendah dari minimum </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:37:05', 20220101, 15, '2022-01-01', 2),
(95, '2022-01-01', 'P.301020103000/100JAM', 4, 4, 5, 5, 8, 23, 0, 'Cargo Crane', 'Melumasi bagian bagian yang bergerak slew ring dan roda gigi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>DENGAN RACK Lumasi secara berkala titik-titik yang ditunjukkan pada derek, dan pada penopang hidrolik, bila dipasang </li><li>DENGAN SLEW RING Beri pelumas pada roda gigi slew untuk mencegah gesekan selama rotasi dan untuk memastikan stabil dengan mencegah air (perlindungan korosi) dan kontaminan masuk ke bantalan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:36:14', 20220101, 17, '2022-01-01', 2),
(96, '2022-01-01', 'P.301020104000/2B', 4, 4, 5, 5, 8, 24, 0, 'Hydraulic Turn Table', 'Periksa dan lumasi komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa Lumasi, oleskan minyak pada bagian atau permukaan yang rentan terhadap gesekan atau lingkungan yang korosif </li><li>Periksa level tangki minyak, Isi jika perlu </li><li>Periksa Filter oli\r\ndan periksa Rol </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:38:16', 20220101, 5, '2022-01-01', 1),
(97, '2022-01-01', 'P.301020104000/6B', 4, 4, 5, 5, 8, 24, 0, 'Hydraulic Turn Table', 'Periksa komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa Baut untuk mengencangkan</li><li>Periksa kebocoran oli di luar / di dalam</li><li>Periksa Motor starter </li><li>Periksa Panel kontrol/Lampu </li><li>Periksa Tombol Tekan </li><li>Periksa kabel listrik </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:38:58', 20220101, 8, '2022-01-01', 1),
(98, '2022-01-01', 'P.301020104000/T', 4, 4, 5, 5, 8, 24, 0, 'Hydraulic Turn Table', 'Periksa komponen dan isi ulang oli hidrolik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa cincin slewing </li><li>Periksa keausan pinion gear slewing </li><li>Periksa dan isi ulang oli hidrolik </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:39:19', 20220101, 9, '2022-01-01', 1),
(99, '2022-01-01', 'P.301020105000/B', 4, 4, 5, 5, 8, 25, 0, 'Hydraulic Snatch Winch', 'Periksa dan lumasi komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lindungi komponen terhadap korosi, bersihkan karat dan lakukan cat ulang</li><li>Berikan lubrikasi pada bagian-bagian yang berputar antara lain Bantalan-bantalan, Rope Drum dan juga pada pasangan Roda gigi</li><li>.Lumasi semua grease point secara teratur</li><li>Periksa seluruh sambungan listrik dan Ganti kabel yang rusak atau aus</li><li>Lakukan pemeriksaan untuk memastikan tidak ada lapisan yang aus atau korosi pada sambungan listrik</li><li>Mengencangkan semua koneksi dan cek tingkat keausan wire rope</li><li>Lakukan pengetesan fungsi dengan cara menaik turunkan ramp door, pastikan berfungsi dengan baik. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:40:22', 20220101, 4, '2022-01-01', 1),
(100, '2022-01-01', 'P.301020105000/4000JAM', 4, 4, 5, 5, 8, 25, 0, 'Hydraulic Snatch Winch', 'Lakukan penggantian Oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Lakukan penggantian Oli pada sistem, disarankan diganti tidak lebih dari 4 (empat) tahun dengan Grade oli yang telah direkomendasikan </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:39:34', 20220101, 28, '2022-01-01', 2),
(101, '2022-01-01', 'P.301020106000/B', 4, 4, 5, 5, 8, 22, 0, 'Accommodation Ladder', 'Lakukan pemeriksaan dan perbikan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa tangga akomodasi dari kondisi, distorsi, retak dan korosi</li><li>Lumasi bagian yang bergerak secara berkala dengan gemuk yang sesuai</li><li>Ganti jika ada tiang penyangga yang bengkok dan tali samping diperiksa dan diganti seperlunya</li><li>Cek struktur titik-titik pendukung dari distorsi, retakan atau korosi</li><li>Jaring pengaman harus diperiksa dari keausan, kerusakan, efek degradasi aktinik, dan untuk impregnasi bahan kimia, minyak atau cat</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:44:29', 20220101, 4, '2022-01-01', 1),
(102, '2022-01-01', 'P.301020107000/B', 4, 4, 5, 5, 8, 25, 0, 'Provision Crane', 'Periksa dan lumasi komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lindungi komponen terhadap korosi, bersihkan karat dan lakukan cat ulang </li><li>Berikan lubrikasi pada bagian-bagian yang berputar antara lain Bantalan-bantalan, Rope Drum dan juga pada pasangan Roda gigi </li><li>Periksa fungsi electric Cargo Winch dengan mengangkat beban beberapa centimeter dari ground dan tahan beban tersebut untuk beberapa saat, kemudian gerakkan perlahan ke arah slewing </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:45:28', 20220101, 4, '2022-01-01', 1),
(103, '2022-01-01', 'P.301020107000/4000JAM', 4, 4, 5, 5, 8, 25, 0, 'Provision Crane', 'Lakukan penggantian Oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Lakukan penggantian Oli pada sistem, disarankan diganti tidak lebih dari 4 (empat) tahun dengan Grade oli yang telah direkomendasikan </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:45:05', 20220101, 28, '2022-01-01', 2),
(104, '2022-01-01', 'P.301020108000/M', 4, 4, 5, 5, 8, 1, 0, 'Lifting Gear for M/E', 'Periksa dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa kamar mesin, ruang luncur dijaga kebersihannya dan bebas dari sampah, debu, dan cecaran minyak </li><li>Lakukan Pembersihan, pengecekan dan pemberian grease roda bearing </li><li>Cek Tali baja dari tanda-tanda retak, putus, berkarat, atau patah pada beberapa komponen kawat atau diameternya susut lebih dari IO% dari ukuran semula harus segera diganti </li><li>Cek Tali baja yang  kering menunjukkan adanya tanda-tanda korosi harus segera dilumasi dengan minyak pelumas khusus </li><li>Lakukan Pengecekan kebocoran, pengecekan baut dan mur, batterei dan kabel  kabel </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:46:24', 20220101, 2, '2022-01-01', 1),
(105, '2022-01-01', 'P.301020108000/3B', 4, 4, 5, 5, 8, 1, 0, 'Lifting Gear for M/E', 'Pengecekan dan penggantian oli', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan Penggantian Oli </li><li>Lakukan Pengecekan baut dan keausan serta bearing </li><li>Lakukan Pengecekan kabel-kabel, kondisi motor bearing serta meager test </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:45:55', 20220101, 6, '2022-01-01', 1),
(106, '2022-01-01', 'P.301020109000/T', 4, 4, 5, 5, 8, 27, 0, 'Manual Slewing Crane', 'Pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek komponen mekanik seperti Poros, bearing, pin, roda gigi, roller, pengunci dan klem, yang mungkin mengalami aus, pecah, retak atau distorsi beban</li><li>Cek komponen rail, beam dll, yang mungkin mengalami deformasi, retak atau pecah karena kerusakan akibat korosi</li><li>Cek komponen rope drum dan sheaves, lapisan dst terhadap kotoran/kerak yang berlebihan</li><li>Cek komponen pengaman beban, dan pengaman alat yang dipasang pada crane</li><li>Cek sambungan seperti baud, mur, pin pengunci yang mungkin aus atau kekenduran </li><li>Cek Deformasi dari Hook, pengecekan Hooks seperti retak atau terkikis</li><li>Cek Hoisting Rope, seperti kawat-kawat mulai putus, aberasi dan tidak tergulung sesuai alur </li><li>Memberikan lubrikasi pada bagian-bagian yang berputar antara lain Bantalan-bantalan, Rope Drum dan juga pada pasangan Roda gigi dll. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:47:07', 20220101, 9, '2022-01-01', 1),
(107, '2022-01-01', 'P.301020110000/6B', 4, 4, 5, 5, 8, 27, 0, 'Sekoci Karet /RHIB', 'Pengecekan dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cuci bersih sekoci agar tidak ada sampah, pasir atau kotoran yang menempel pada badan unit dan terhindar dari hewan pengerat. Keringkan lalu taburkan bedak (bisa menggunakan bedak apa saja) agar sekoci tetap kering, tutup kembali sekoci dengan cover bag</li><li>Cek sekoci dari kerusakan atau kebocoran, segera perbaiki jika ada kerusakan atau kebocoran dengan Repair Kit </li><li>Cek mesin sekoci dan tes gerakan maju dan mundur, setidaknya dalam waktu 3 menit. Pada saat pengecekan ini perlu diperiksa apakah mesin bekerja dengan semestinya</li><li>Laksankan pelumasan points  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:47:54', 20220101, 8, '2022-01-01', 1),
(108, '2022-01-01', 'P.301020111000/100JAM', 4, 4, 5, 5, 8, 28, 0, 'Mesin Sekoci Yamaha', 'Pemeriksaan dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Ganti filter bahan bakar </li><li>Ganti termostat jika perlu </li><li>Ganti Oli mesin </li><li>Ganti Busi, ganti Trim Tab jika perlu</li><li>Ganti Oli Roda Gigi, ganti set roda gigi jika perlu</li><li>Ganti propeler jika perlu </li><li>Lakukan Pemeriksaan dan pembersihan Cerat tangki minyak dan saluran air pendingin mesin tempel </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:49:39', 20220101, 17, '2022-01-01', 2),
(109, '2022-01-01', 'P.301030101000/T', 4, 4, 6, 6, 8, 29, 0, 'Jangkar', 'Bersihkan dan lumasi dengan bahan anti karat', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pembersihan jangkar kapal yang telah digunakan agar terbebas dari lumpur atau kotoran lain</li><li>Pelumasan bahan anti karat pada permukaan jangkar kapal. Pelumasan bisa dilakukan dengan bahan yang sesuai, untuk bahan besi seperti varmasin </li><li>Memberikan lapisan pada pipa yang telah dicat dengan cat anti karat atau korosif. Bisa juga dengan memberikan lapisan timah seperti pada kaleng</li><li>Jika telah terjadi karat, cara untuk menghilangkan lapisan karat tersebut dengan diketok, dibersihkan dengan amplas. Untuk menghilangkan sisa kotoran yang terdapat pada permukaan jangkar, lalu dicat dengan cat anti karat </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:50:46', 20220101, 9, '2022-01-01', 1),
(110, '2022-01-01', 'P.301030102000/T', 4, 4, 6, 6, 8, 30, 0, 'Rantai Jangkar, Segel & Swifel', 'Pembersihan dan pengecatan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan rantai dari debu dan karat menggunakan kompresor dan palu </li><li>Lakukan pengecetan pada rantai menggunakan cat black bituminous agar tahan terhadap korosi</li><li>Cek diameter mata rantai dalam suatu segel memiliki diameter dibawah minimum yang dijinkan bureau Veritas(0.88 D m/m), maka  rantai sepanjang segel tersebut harus diganti</li><li>Pastikan ulup rantai selalu ditutup terpal pada saat tidak digunakan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:51:22', 20220101, 9, '2022-01-01', 1),
(111, '2022-01-01', 'P.301030103000/B', 4, 4, 6, 6, 8, 23, 0, 'Anchor Wire Steel Wire Rope', 'Pemberian gemuk', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Lakukan lubrikasi atau berikan gemuk / oli pada Anchor Wire Steel. Hal ini dilakukan untuk menahan proses pengaratan dari wire Steel sehingga dapat tahan lebih lama. </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:51:44', 20220101, 4, '2022-01-01', 1),
(112, '2022-01-01', 'P.301030104000/3B', 4, 4, 6, 6, 8, 31, 0, 'Mooring rope Poly Propeline', 'Pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek dan pastikan tali terhindar dari air dan udara lembab. Disimpan di tempat yang kering dan tidak lembab</li><li>Memastikan jika tali basah agar dikeringkan lebih dahulu dengan cara dianginanginkan sebelum disimpan </li><li>Memastikan tali tidak berhubungan langsung dengan besi kapal (dek dan dinding kapal) dengan cara diberikan ganjal (dunnage) dari kayu </li><li>Cek dan jauhkan Tali agar tidak tersentuh dari cairan asam, minyak, ataupun gemuk </li><li>Memastikan agar tali tidak kusut dengan cara digulung searah dengan arah pintalannya </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:52:18', 20220101, 6, '2022-01-01', 1),
(113, '2022-01-01', 'P.301030105000/T', 4, 4, 6, 6, 8, 31, 0, 'Double Bolder', 'Pembersihan dan pengecatan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan Double Bolder dari kotoran dan pastikan tidak ada lapisan cat yang terkelupas, jika ada korosi segera bersihkan dengan gerinda </li><li>Lakukan pengecetan ulang jika ada cat yang terkelupas, pastikan cat atau lapisan bubuknya tidak tergores yang memungkinkan terjadinya korosi. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:52:38', 20220101, 9, '2022-01-01', 1),
(114, '2022-01-01', 'P.301040101000/3B', 4, 4, 7, 7, 8, 22, 0, 'Sekoci penolong (LdVP)', 'Pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div>Prosedur Perawatan :<br></div><ol><li>Periksa dan bersihkan peralatan sekoci penolong </li><li>Cek Penampilan pengait sekoci dan alat menurunkan sekoci, mencoba tenaga penggerak sekoci </li><li>Cek perbekalan dan peralatan yang ada di dalam sekoci seperti makanan, air, dan obat-obatan apakah sudah expired atau belum jika sudah mendekati expired atau sudah expired </li><li>Memastikan Kompas bekerja dengan baik </li><li>Pemeriksaan dan penggantian Propeller dan pena koter</li><li>Pemeriksaan dan pembersihan,crat tangki minyak </li><li>Melakukan penggantian oli mesin sekoci </li><li>Jalankan mesin sekoci dan tes gerakan maju dan mundur, setidaknya dalam waktu 3 menit </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:53:18', 20220101, 6, '2022-01-01', 1),
(115, '2022-01-01', 'P.301040102000/3T', 4, 4, 7, 7, 8, 32, 0, 'Life Buoy', 'Pemeriksaan dan pengujian lampu lifebuoy', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa lifebuoy dari tanda-tanda kerusakan. Jika ada kerusakan lakukan perbaikan, ganti jika perlu </li><li>Lakukan pengecatan ulang jika warna cat sudah mulai pudar </li><li>Periksa masa pakai baterai lampu lifebuoy, jika sudah melewati 3 tahun lakukan penggantian dengan yang baru </li><li>Uji lampu lifebuoy dengan menarik keluar klip dengan hati-hati dan biarkan kepala lampu tegak, dan kemudian lampu lifebuoy harus berkedip sekaligus. Dan letakkan kepala lampu ke bawah, dan kemudian akan berhenti berkedip juga. Kemudian ganti lampu lifebuoy kembali ke klip. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:54:20', 20220101, 11, '2022-01-01', 1),
(116, '2022-01-01', 'P.301040103000/T', 4, 4, 7, 7, 8, 33, 0, 'Smoke Signal', 'Periksa secara visual Smoke Signal', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Cek tanggal expire, lakukan penggantian jika warna sudah mulai pudar dan melebihi masa expire </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:54:36', 20220101, 9, '2022-01-01', 1),
(117, '2022-01-01', 'P.301040104000/T', 4, 4, 7, 7, 8, 34, 0, 'Baju Penolong (Life Jacket)', 'Periksa secara visual Life Jacket', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa Life Jacket dari kerusakan dan kebocoran </li><li>Cuci dan bersihkan life jacket dari kotoran dan debu yang menempel </li><li>Periksa kelayakan dan fungsi </li><li>Periksa kelengkapan seperti lampu, fluit, reflektor dan lakukan tes fungsi</li><li>Bersihkan box penyimpanan life jacket </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:55:07', 20220101, 9, '2022-01-01', 1),
(118, '2022-01-01', 'P.301040105000/T', 4, 4, 7, 7, 8, 35, 0, 'Red Hand Flare', 'Periksa secara visual Red Hand Flare', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Cek kondisi kelayakan dan tanggal expire, lakukan penggantian jika warna sudah mulai pudar dan melebihi masa expire </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:55:22', 20220101, 9, '2022-01-01', 1),
(119, '2022-01-01', 'P.301040106000/T', 4, 4, 7, 7, 8, 36, 0, 'Fire Axe', 'Bersihkan Fire Axe', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Bersihkan Fire Axe dan periksa fungsi dan kelayakannya. Pastikan alat dalam kondisi siap pakai. </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:55:38', 20220101, 9, '2022-01-01', 1),
(120, '2022-01-01', 'P.301040107000/T', 4, 4, 7, 7, 8, 37, 0, 'Fire Hoses and Nozzle + Fire Box', 'Bersihkan komponen dan lakukan simulasi pemakaian selang pemadam', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Melakukan simulasi pemakaian selang pemadam kebakaran, agar selang tidak lengket serta tidak kaku </li><li>Pastikan selang tidak bocor dan dapat mengalirkan air dari fire hydrant dengan baik </li><li>Pastikan selang selalu dalam kondisi kering dalam box hydrant agar selang tidak berjamur dan lengket </li><li>Bersihkan nozzle dari kotoran dengan air, gosok-gosok dengan alat penggosok khusus jika ada material yang menyumbat </li><li>Pastikan nozzle tidak bocor atau pecah, jika pecah atau rusak segera diganti </li><li>Bersihkan hydrant box dari kotoran dan karat pada plat box, lakukan pengecetan jika cat mulai mengelupas </li><li>Memastikan hydrant box tidak terhalang oleh benda benda yang dapat menyulitkan petugas  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:56:10', 20220101, 9, '2022-01-01', 1);
INSERT INTO `kartu_pemeliharaan` (`id`, `tanggal`, `kode_pemeliharaan`, `id_komponen_pokok`, `id_komponen_sub_pokok`, `id_sistem`, `id_sub_sistem`, `id_pelaksana`, `id_lokasi`, `id_kapal`, `komponen`, `uraian_pemeliharaan`, `tindakan_pengamanan`, `prosedur`, `alat_kerja`, `jo`, `created_at`, `updated_at`, `user_create`, `id_periode`, `tgl_mulai`, `id_jenis_perawatan`) VALUES
(121, '2022-01-01', 'P.301040108000/B', 4, 4, 7, 7, 8, 38, 0, 'Fire extuingiser Cap. 9 KG', 'Bersihkan dan membolak balikan tabung', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Untuk type Stored Pressure. Pastikan gas pendorong di dalam tabung tidak bocor dan dalam keadaan bertekanan.</li><li>Untuk type Cartridge. Cek segel di tabung Cartridge yg berada di leher tabung, apakah masih dalam keadaan utuh, lalu kembalikan pada posisi semula.&nbsp;</li><li>Bersihkan tabung dari debu, air, maupun korosi. Caranya gosok tabung dgn kain basah hingga tak ada lagi debu, lalu gosok lagi dgn kain kering</li><li>Bolak-balikan tabung guna menghindari pembekuan pada cairan dalam tabung. Caranya, satu tangan memegang bagian atas tabung, dan tangan satunya lagi memegang bagian bawah tabung. Lalu bagian atas tabung dibalik ke bawah dan sebaliknya. Lakukan hingga 3 sampai 5 kali secara perlahan</li><li>Pastikan Valve, Selang, Meter Pressure dan Segel dalam keadaan baik</li><li>Yakinkan posisi Bracket dalam keadaan kuat dan melekat sempurna dgn dinding. (Berlaku untuk tabung model Portable Standard, baik Stored Pressure &amp; Cartridge)</li><li>Usahakan agar tabung terhindar dari kontak langsung matahari dan hujan, disarankan untuk memberi penutup/canopy/ pelindung pada tabung demi menjaga kualitas tabung lebih tahan lama. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 08:59:31', 20220101, 4, '2022-01-01', 1),
(122, '2022-01-01', 'P.301040109000/T', 4, 4, 7, 7, 8, 39, 0, 'CO2 Sistem untuk E/R (AF11E)', 'Lakukan pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan Penimbangan </li><li>Lakukan Pengecekan pipa</li><li>Lakukan Alarm test dan pilot (kendali) </li><li>Pengecekan valve dari karat </li><li>Pemberian grease pada handle pilot(kendali) </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:01:08', 20220101, 9, '2022-01-01', 1),
(123, '2022-01-01', 'P.301040110000/T', 4, 4, 7, 7, 8, 35, 0, 'Parachute Signal', 'Periksa secara visual', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Cek kelaiakan dan tanggal expire, lakukan penggantian jika sudah melebihi masa expire yaitu lebih dari 3 tahun </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:01:28', 20220101, 9, '2022-01-01', 1),
(124, '2022-01-01', 'P.301040111000/T', 4, 4, 7, 7, 8, 40, 0, 'Smoke Detector dan Heat Detector', 'Lakukan pengecekan dan kalibrasi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Kalibrasi dan uji sensor alarm kebakaran, termasuk detektor sensor asap, panas, percikan dan lainnya terhadap nyala api </li><li>Cek dan bersihkan elemen kisi udara dari sumbatan debu, karena bisa mengakibatkan berkurangnya sensitifitas detector </li><li>Uji suara alarm kebakaran dan melakukan simulasi. Hal ini memerlukan petunjuk yang sangat spesifik dan sebaiknya diserahkan kepada orang-orang yang profesional</li><li>Mengatur sensitivitas alarm kebakaran itu dengan mengikuti panduan dan instruksi dari brand yang dipasang </li><li>Lakukan pergantian baterai alarm kebakaran dan uji input alarm kebakaran dengan layanan darurat </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:02:00', 20220101, 9, '2022-01-01', 1),
(125, '2022-01-01', 'P.301040112000/T', 4, 4, 7, 7, 8, 35, 0, 'Life line thowing aparatus c/w cartridge', 'Periksa secara visual', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ul><li>Cek kelaiakan dan tanggal expire, lakukan penggantian jika sudah melebihi masa expire yaitu lebih dari 3 tahun </li></ul>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:02:15', 20220101, 9, '2022-01-01', 1),
(126, '2022-01-01', 'P.301040113000/T', 4, 4, 7, 7, 8, 41, 0, 'Emergency Escape Breathing Aparatus/EEBD', 'Pemeriksaan komponen dan Uji hidrostatik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan </u>:<br></div><ol><li>Periksa pengukur silinder untuk memastikan berada dalam kisaran tekanan yang benar </li><li>Uji hidrostatik dan pemeriksaan internal silinder </li><li>Cek sensor kelembaban untuk mengetahui hilangnya segel vakum dengan cara melihat perubahan warna dari biru muda menjadi putih atau merah muda </li><li>Lakukan inspeksi untuk memastikan bahwa perangkat belum rusak, kehilangan segel vakum, atau melebihi masa simpannya.  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:02:44', 20220101, 9, '2022-01-01', 1),
(127, '2022-01-01', 'P.301040114000/B', 4, 4, 7, 7, 8, 42, 0, 'Emergency Lighting', 'Pemeriksaan dan pembersihan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan lampu emergency dengan kain halus dan sedikit diberi air </li><li>Lakukan pengecekan apakah lampu emergency masih berfungsi atau tidak </li><li>Periksa semua gasket-gasket dan sambungan kabel</li><li>Periksa ruang baterai harus selalu dalam keadaan bersih, kering dan tidak terdapat kebocoran cairan elektrolit</li><li>Lakukan pengisian baterai sesuai jadwal dan sesuai hasil pemantauan</li><li>Lakukan pengukuran pada baterai maupun panel DC dengan menggunakan multitester secara berkala untuk memastikan performance dari baterai</li><li>Apabila ada kerusakan pada lampu emargeny maka segera dilakukan penggantian atau perbaikan lampu emergency </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:04:05', 20220101, 4, '2022-01-01', 1),
(128, '2022-01-01', 'P.301040115000/6B', 4, 4, 7, 7, 8, 35, 0, 'Immersion Suit', 'Lakukan pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa kondisi tas jas dari kerusakan, kotoran atau petunjuk yang tidak terbaca </li><li>Keluarkan jas dari tas dan letakkan di atas meja datar yang bersih. Periksa secara visual bagian dalam dan luar jas dari jahitan yang rusak atau kerusakan lainnya. Jika ada kerusakan segera diperbaiki oleh pabrik atau bengkel yang disarankan khusus</li><li>Periksa kelengkapan peralatan seperti peluit, kait karabin, lilin untuk ritsleting, lampu darurat dll. Jika ada yang rusak atau hilang segera ganti dengan suku cadang asli dari pabrikan</li><li>Periksa area ritsleting untuk jahitan yang rusak terutama di ujung bawah ritsleting di dalam jas. Periksa ritsleting secara visual apakah ada kerusakan atau korosi. Hapus semua kotoran dari ritsleting dan gerakkan penggeser beberapa kali ke atas dan ke bawah. Lumasi gigi ritsleting dengan tongkat lilin</li><li>Nyalakan dan matikan lampu dan periksa validitas lampu. Jika lampu sudah kadaluarsa atau rusak, ganti  baru</li><li>Bersihkan jas dari kotoran dengan mencuci dengan air hangat dan campuran sabun.</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:06:17', 20220101, 8, '2022-01-01', 1),
(129, '2022-01-01', 'P.301040116000/B', 4, 4, 7, 7, 8, 43, 0, 'Inflatable Life Raft', 'Pemeriksaan dan memastikan komponen dalam kondisi baik', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pastikan peti kemas diikat secara benar ke ayunan nya dan tidak memiliki retak-retak atau tempat yang tidak kuat (lemah) </li><li>Pastikan peti kemas pengamanan tali pengikat tidak memiliki potong-potong dan masih kuat </li><li>Pastikan garis pelukis tidak dirusakkan dan itu masih dijamin aman </li><li>Pemeriksaan kawat winch, sheaves dan slewing gear untuk memastikan pelumasan yang memadai, bebas dari korosi dan cat yang berlebihan </li><li>Pastikan casing rakit tidak menunjukkan tanda-tanda kerusakan  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:06:51', 20220101, 4, '2022-01-01', 1),
(130, '2022-01-01', 'P.301040117000/B', 4, 4, 7, 7, 8, 44, 0, 'Fireman Outfit', 'Mencuci pakaian pemadam', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cucilah pakaian pemadam Seminggu Sekali </li><li>Gunakanlah Detergen Dengan PH yang Rendah saat mencuci Pakaian </li><li>Jangan Menggunakan Sikat Bertipe Keras saat mencuci Pakaian </li><li>Jangan Mencuci Pakaian pemadam dengan Suhu di Atas 50 Derajat Celcius </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:07:17', 20220101, 4, '2022-01-01', 1),
(131, '2022-01-01', 'P.301040118000/T', 4, 4, 7, 7, 8, 45, 0, 'Fire Blanket', 'Pengecekan Fire Blanket dari kerusakan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lepaskan Fire Blanket dari penutupnya </li><li>Periksa Fire Blanket dan penutupnya dalam kondisi baik </li><li>Cek instruksi pengoperasian Fire Blanket dan bersihkan agar mudah terbaca </li><li>Cek Fire Blanket dari kerusakan, pastikan tidak rusak dan hilang </li><li>Ganti Fire Blanket jik arusak dan catat detailnya pada label servis </li><li>Tempatkan Fire Blanket dengan benar di tempat yang ditentukan dan tidak terhalang </li><li>Pastikan Fire Blanket diamankan pada ketinggian yang benar dan dapat dibuka tanpa halangan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:08:07', 20220101, 9, '2022-01-01', 1),
(132, '2022-01-01', 'P.301050101000/M', 4, 4, 8, 8, 8, 1, 0, 'Fire & GS Pump', 'Lakukan pengecekan dan pemberian grease', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pengecekan secara visual, tentang operasional pompa secara keseluruhan</li><li>Pemberian grease (gemuk) pada bearing pompa atau pada bagian pompa yang bergerak</li><li>Pengecekan sistim kelistrikan pada pompa</li><li>Mencatat kegiatan perawatan harian pompa pada buku jurnal harian mesin. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:08:31', 20220101, 2, '2022-01-01', 1),
(133, '2022-01-01', 'P.301050101000/T', 4, 4, 8, 8, 8, 1, 0, 'Fire & GS Pump', 'Pengecekan dan penggantian komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pengecekan kebocoran rumah pompa yang disebabkan oleh karet, pada semua jenis pompa</li><li>Penggantian reames packing, yang fungsinya untuk menjaga kerapatan antara rumah pompa dengan poros penggerak impeller</li><li>Pengecekan packing karet rumah pompa dari adaanya kebocoran</li><li>Penggantian seal rumah pompa, pada pompa sentrifugal </li><li>Penggantian sudu-sudu impeller pompa, ball bearing rumah pompa jika yang lama tidak dapat digunakan lagi pada pompa sentrifugal </li><li>Pengecekan kelurusan poros penggerak impeller pompa</li><li>Pengecekan dan penggantian katup pada pompa torak. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:09:12', 20220101, 9, '2022-01-01', 1),
(134, '2022-01-01', 'P.301050102000/M', 4, 4, 8, 8, 8, 46, 0, 'Emergency Fire Pump', 'Melakukan pengetesan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan pengetesan sistem selama 10 menit agar pompa selalu Stand By untuk keadaan darurat </li><li>Secara berkala periksa air radiator dan tambahkan bila perlu </li><li>Secara berkala periksa level Air Battery dan tambahkan bila perlu. Gunakan airAccu Aquades untuk menambahkan. Jangan gunakan Accu Zuur </li><li>Lakukan penggantian oli setiap 50 jam operasi </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:09:58', 20220101, 2, '2022-01-01', 1),
(135, '2022-01-01', 'P.301050102000/T', 4, 4, 8, 8, 8, 46, 0, 'Emergency Fire Pump', 'Periksa sistem bahan bakar dan ganti filter', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa sistem bahan bakar, bersihkan drain secara berkala untuk membuang endapan kotoran atau air </li><li>Ganti filter bahan bakar (Fuel Filter) setiap 150 jam  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:10:53', 20220101, 9, '2022-01-01', 1),
(136, '2022-01-01', 'P.301050103000/H', 4, 4, 8, 8, 8, 15, 0, 'Bilge & Ballast Pump', 'Pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek temperatur bantalan dan rumah pompa: Dapat dirasakan dengan tangan</li><li>Cek tekanan isap dan tekanan keluar dengan melihat penunjukan manometer dan vakummeter </li><li>Cek kebocoran dari kotak packing, amati secara visual </li><li>Cek Arus Listrik, lihat pada amperemeter</li><li>Cek jumlah minyak pelumas di dalam rumah bantalan dan perputaran cincin minyak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:12:25', 20220101, 1, '2022-01-01', 1),
(137, '2022-01-01', 'P.301050103000/6B', 4, 4, 8, 8, 8, 15, 0, 'Bilge & Ballast Pump', 'Pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pemeriksaan tahanan isolasi pada motor pompa </li><li>Pemeriksaan atau pergantian minyak di dalam rumah bantalan </li><li>Pemeriksaan grease (gemuk)pada bearing pompa, grease harus diganti jika kondisinya memburuk</li><li>Pemeriksaan packing tekan dan selubung poros, jika pada selubung poros terlihat alur-alur dalam karena aus, packing dan selubung poros harus diganti. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:11:47', 20220101, 8, '2022-01-01', 1),
(138, '2022-01-01', 'P.301050103000/5T', 4, 4, 8, 8, 8, 15, 0, 'Bilge & Ballast Pump', 'Pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek keausan pada bagian-bagian yang berputar </li><li>Cek dan bersihkan korosi didalam rumah pompa </li><li>Melepas impeller, dan periksa ukuran impeller dan alur pasaknya, pastikan pasak benarbenar pas dan tidak goyang </li><li>Cek kelurusan poros, harus dilakukan pelurusan kembali setelah pompa dibongkar dan dipasang</li><li>Cek tahanan isolator motor, ukur kembali setelah pembongkaran ataupun pemasangan kembali. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:11:19', 20220101, 13, '2022-01-01', 1),
(139, '2022-01-01', 'P.301050104000/H', 4, 4, 8, 8, 8, 1, 0, 'FO & LO Transfer Pump', 'Lakukan pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek bahwa tidak ada kavitasi di dalam casing pompa </li><li>Cek slide bearings yang dilumasi itu terlumasi </li><li>Cek ball/roller bearings terbuka itu dilumasi </li><li>Cek bahwa ada cairan sehubungan dengan slide bearings yang dilumasi cairan </li><li>Cek bahwa setiap perangkat pelumas berfungsi dengan baik </li><li>Cek bahwa setiap pipa sirkulasi pipa pendingin, pemanas, atau air bertekanan berfungsi dengan baik </li><li>Cek output daya dan konsumsi daya itu benar </li><li>Cek aliran dan tekanan operasional itu benar </li><li>Cek bahwa maks. suhu yang diizinkan sesuai </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:13:24', 20220101, 1, '2022-01-01', 1),
(140, '2022-01-01', 'P.301050104000/M', 4, 4, 8, 8, 8, 1, 0, 'FO & LO Transfer Pump', 'Pengecekan komponen dan pemberian grease', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek bahwa setiap filter dan lubang drainase bersih </li><li>Cek bahwa kotak isian bocor 10-100 tetes per menit </li><li>Memastikan segel poros mekanis itu tidak bocor </li><li>Cek bahwa lingkungan kotak isian dan bantalan bebas dari kotoran </li><li>Berikan grease high temperature pada bearing pompa </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:13:52', 20220101, 2, '2022-01-01', 1),
(141, '2022-01-01', 'P.301050104000/2B', 4, 4, 8, 8, 8, 1, 0, 'FO & LO Transfer Pump', 'Pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memastikan bearings tidak terlalu banyak bermain </li><li>Cek bahwa katup bypass berfungsi dengan benar dan terbuka pada tekanan yang tepat </li><li>Cek bahwa kotak isiannya masih utuh </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:12:47', 20220101, 5, '2022-01-01', 1),
(142, '2022-01-01', 'P.301050105000/2M', 4, 4, 8, 8, 8, 1, 0, 'FW Sanitary Pump', 'Bersihkan dan periksa komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan pompa, area dalam panel pompa, dan panel pompa. Jaga agar peralatan tetap bersih, kering, dan dicat </li><li>Lakukan penggantian spare part jika pada saat pemeriksaan panel pompa ada catatan komponen yang rusak </li><li>Bersihkan induction motor pompa bagian baling-baling pendingin motor\r\n4.Kencangkan bolt terminal power dan bersihkan bagian luar induction motor</li><li>Cek karet kopling dan bersihkan bagian luar pompa </li><li>Periksa impeller dan bantalan pompa dari keausan internal untuk korosi, erosi dan kavitasi </li><li>Periksa semua sambungan &amp; komponen listrik, Lumasi bearing pompa dengan grease high temp </li><li>Tes pompa dan pastikan tidak ada masalah yang muncul pada saat pompa berjalan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:14:30', 20220101, 3, '2022-01-01', 1),
(143, '2022-01-01', 'P.301050106000/M', 4, 4, 8, 8, 8, 1, 0, 'SW Cooling Pump for AC', 'Pengecekan komponen dan pemberian grease', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>&nbsp;Cek tekanan isap dan tekanan keluar pada pompa</li><li>Pengecekan kebocoran pada bagian pompa</li><li>Pemberian grease (gemuk) pada bagian bearing pompa pastikan tidak kering</li><li>Pengecekan rumah pompa (casing perhatikan bila ada kekeroposan, kebocoran karena korosi)</li><li>Pengecekan impeller terhadap keutuhan impeller mungkin kemakan korosi </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:15:45', 20220101, 2, '2022-01-01', 1),
(144, '2022-01-01', 'P.301050106000/3B', 4, 4, 8, 8, 8, 1, 0, 'SW Cooling Pump for AC', 'Pengecekan komponen dan penggantian minyak bantalan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pengecekan bearing atau bushing yang kedapatan sudah tidak lancer kita ganti</li><li>Pengecekan packing pada rumah pompa dan poros pompa kedapatan bocor apa tidak</li><li>Pengecekan grease (gemuk) pada bearing pompa bila kedapatan kering segera diganti</li><li>Pengecekan kelurusan shaft pompa dengan shaft motor penggerak</li><li>Pengecekan pada motor listrik adalah : Ball bearing, Kelurusan poros dengan pompa, Kekencangan ikatan kabel dan baut pengikat </li><li>Penggantian minyak di dalam rumah bantalan\r\n7.Pemerikasaan grease (gemuk), bila kurang ditambah atau diganti. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:15:13', 20220101, 6, '2022-01-01', 1),
(145, '2022-01-01', 'P.301050106000/T', 4, 4, 8, 8, 8, 1, 0, 'SW Cooling Pump for AC', 'Pemeriksaan packing dan pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pemeriksaan packing atau mechanical seal dan selubung poros, jika pada selubung poros terlihat alur dalam karena keausan maka packing dan selubung poros harus diganti</li><li>Keadaan poros pompa dan poros motor. Jika kelurusan banyak menyimpang sesuai dengan posisi yang ditentukan pada waktu pompa dipasang harus dilakukan kelurusan lagi</li><li>Cek keausan pada bagian-bagian yang berputar</li><li>Cek korosi di dalam rumah pompa. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:16:15', 20220101, 9, '2022-01-01', 1),
(146, '2022-01-01', 'P.301050107000/M', 4, 4, 8, 8, 8, 1, 0, 'FW Cooling Pump', 'Pengecekan komponen dan pemberian grease', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek tekanan isap dan tekanan keluar pada pompa</li><li>Pengecekan kebocoran pada bagian pompa</li><li>Pemberian grease (gemuk) pada bagian bearing pompa pastikan tidak kering</li><li>Pengecekan rumah pompa (casing perhatikan bila ada kekeroposan, kebocoran karena korosi)</li><li>Pengecekan impeller terhadap keutuhan impeller mungkin kemakan korosi </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:17:17', 20220101, 2, '2022-01-01', 1),
(147, '2022-01-01', 'P.301050107000/6B', 4, 4, 8, 8, 8, 1, 0, 'FW Cooling Pump', 'Pemeriksaan komponen-komponen pompa', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan pemeriksaan komponen-komponen pompa \r\n1.Pengecekan tekanan air pada alat ukur (pressure gauge)</li><li>Cek evaporator pada pipa-pipa pemanas harus diperiksa dan dibersihkan dari kerak-kerak atau karat yang menempel melalui metode kimia</li><li>Pada bagian Kondensor buka penutup kondensor dan pipa-pipa pendinginnya diperiksa dari kemungkinan pembentukan kerak-kerak serta dibersihkan</li><li>Periksa Ejector bagian nozzle dan diffuse (penyembur), cek dari kemungkinan kerusakan, bila tersumbat dari kotoran bersihkan dan bila terjadi kerusakan segera diadakan perbaikan</li><li>Strainer/saringan pada pipa air pendingin dilepas dan dibersihkan dengan air bertekanan </li><li>Periksa komponen-komponen pompa pada bagian imfeller, casing ring, shaft dari kerusakan dan korosi  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:16:50', 20220101, 8, '2022-01-01', 1),
(148, '2022-01-01', 'P.301050108000/M', 4, 4, 8, 8, 8, 1, 0, 'Sewage Pump', 'Pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa dan pastikan saluran hisap dan sambungan benar-benar kedap udara </li><li>Periksa apakah katup hisap terbuka penuh </li><li>Periksa apakah filter hisap tersumbat atau meshingnya terlalu kecil </li><li>Periksa dengan komparator putaran ujung poros dari pompa dan motor </li><li>Pasang katup pembersih udara pada saluran pembuangan, buka katup sampai semua udara keluar dan tutup setelahnya </li><li>Periksa apakah by-pass valve movil piston tersumbat. Jika demikian, buka blokirnya </li><li>Periksa konsumsi daya, rpm, tegangan dan frekuensi motor listrik dan bandingkan dengan spesifikasi pelat motor</li><li>Sesuaikan pengaturan katup by-pass. Ganti pegas utama jika telah kehilangan fleksibilitas </li><li>Kurangi jumlah rpm untuk memompa cairan yang sangat kental </li><li>Setel ulang katup by-pass dengan katup periksa debit tertutup Setel tekanan 10% di atas tekanan kerja </li><li>Periksa keberadaan benda asing pada pompa. Bongkar dan bersihkan dengan hati-hati, Jika ada kerusakan yang parah ganti baru</li><li>Periksa apakah cairan yang dipompa kehilangan kapasitas pelumasnya karena suhu tinggi </li><li>Cek blok karet kopling, jika aus setelah waktu yang lama harus diganti. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:20:06', 20220101, 2, '2022-01-01', 1),
(149, '2022-01-01', 'P.301050109000/H', 4, 4, 8, 8, 8, 1, 0, 'Dirty Oil Pump', 'Pengecekan pompa dan memastikan pompa tidak bergetar atau mengeluarkan suara yang tidak normal', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memastikan pompa tidak bergetar atau mengeluarkan suara yang tidak normal </li><li>Cek bahwa tidak ada kavitasi di dalam casing pompa </li><li>Cek slide bearings yang dilumasi itu terlumasi </li><li>Cek ball/roller bearings terbuka itu dilumasi </li><li>Cek bahwa ada cairan sehubungan dengan slide bearings yang dilumasi cairan </li><li>Cek bahwa setiap perangkat pelumas berfungsi dengan baik </li><li>Cek bahwa setiap pipa sirkulasi pipa pendingin, pemanas, atau air bertekanan berfungsi dengan baik </li><li>Cek output daya dan konsumsi daya itu benar </li><li>Cek aliran dan tekanan operasional itu benar </li><li>Cek bahwa maks. suhu yang diizinkan sesuai </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:22:12', 20220101, 1, '2022-01-01', 1),
(150, '2022-01-01', 'P.301050109000/M', 4, 4, 8, 8, 8, 1, 0, 'Dirty Oil Pump', 'Pengecekan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek bahwa setiap filter dan lubang drainase bersih </li><li>Cek bahwa kotak isian bocor 10-100 tetes per menit </li><li>Memastikan segel poros mekanis itu tidak bocor </li><li>Cek bahwa lingkungan kotak isian dan bantalan bebas dari kotoran </li><li>Cek apakah elemen penghubung fleksibel dipakai, diganti jika sudah aus </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:22:45', 20220101, 2, '2022-01-01', 1),
(151, '2022-01-01', 'P.301050109000/2B', 4, 4, 8, 8, 8, 1, 0, 'Dirty Oil Pump', 'Memastikan bearings tidak terlalu banyak bermain', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Memastikan bearings tidak terlalu banyak bermain </li><li>Cek bahwa katup bypass berfungsi dengan benar dan terbuka pada tekanan yang tepat </li><li>Cek bahwa kotak isiannya masih utuh </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:21:27', 20220101, 5, '2022-01-01', 1),
(152, '2022-01-01', 'P.301050110000/M', 4, 4, 8, 8, 8, 1, 0, 'J.W PREHEATER UNIT', 'Pemeriksaan komponen dan Pembersihan kotoran yang menempel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pembersihan kotoran yang menempel pada peralatan PreHeater </li><li>Pemeriksaan level pelumas bearing dan gear box </li><li>Pemeriksaan kebocoran minyak pelumas </li><li>Pemeriksaan kebocoran gas buang </li><li>Pemeriksaan filter pelumas </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:24:47', 20220101, 2, '2022-01-01', 1),
(153, '2022-01-01', 'P.301050110000/B', 4, 4, 8, 8, 8, 1, 0, 'J.W PREHEATER UNIT', 'Lakukan pemeriksaan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pemeriksaan baut-baut pengencang peralatan akibat vibrasi </li><li>Pemeriksaan kelainan suara dan vibrasi pada peralatan, pengukuran vibrasi dan jika terjadi fibrasi yang mengkhawatirkan maka dilakukan pengukuran secara khusus </li><li>Pemeriksaan bearing gear box dan sektor plate </li><li>Pemeriksaan kebocoran dari gas buang </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:24:23', 20220101, 4, '2022-01-01', 1),
(154, '2022-01-01', 'P.301050110000/T', 4, 4, 8, 8, 8, 1, 0, 'J.W PREHEATER UNIT', 'Pemeriksaan komponen dan Pembersihan endapan lumpur di bagian bawah bejana', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pemeriksaan dan penggantian minyak pelumas bearing dan gear box </li><li>Pemeriksaan dan perbaikan kondisi support bearing dan guide bearing </li><li>Oleskan beberapa tetes minyak silikon ke poros di antara bangku motor dan kopling untuk mencegah segel saling menempel </li><li>Pemeriksaan dan perbaikan elemen-elemen yang rusak </li><li>Bersihkan Endapan lumpur di bagian bawah bejana tekan dengan cairan pelarut yang sesuai dari produsen terkenal </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:25:10', 20220101, 9, '2022-01-01', 1),
(155, '2022-01-01', 'P.301050111000/3B', 4, 4, 8, 8, 8, 1, 0, 'HT COOLER', 'Pengecekan komponen dan menambah air tawar yang berkurang', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Menambah air tawar yang berkurang di dalam tabung heat exchanger secukupnya </li><li>Pada pompa air tawar, lakukan pengecekan balting, jika balting tidak layak maka digantikan yang baru </li><li>Pada pompa air laut, ganti  karet  balting  yang  rusak  agar  pompa  bekerja  dengan  normal  dalam menghisap air laut </li><li>Memeriksa pipa atau selang air laut sebelum sistem pendingin bekerja agar tidak terjadi kebocoran </li><li>Memeriksa pipa atau selang air tawar sistem pendingin sebelum sistem pendingin bekerja agar tidak terjadi kebocoran </li><li>Memeriksa saringan air laut di dalam tabung heat exchanger untuk  mencegah tersumbatnya aliran air laut ke dalam heat exchange </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:25:40', 20220101, 6, '2022-01-01', 1),
(156, '2022-01-01', 'P.301050112000/M', 4, 4, 8, 8, 8, 47, 0, 'Pompa Avtur', 'Periksa dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan area dalam panel dan rapikan kabel yang kurang rapih </li><li>Kencangkan bolt terminal dan bolt connecting </li><li>Lakukan penggantian spare part jika pada saat pemeriksaan ada komponen yang usang/rusak </li><li>Periksa saluran hisap kedap udara dengan menggunakan alat pengukur vakum </li><li>Bersihkan bagian luar pompa dari kotoran  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:26:07', 20220101, 2, '2022-01-01', 1),
(157, '2022-01-01', 'P.401010101000/M', 5, 5, 9, 9, 8, 35, 0, 'Marine Radar', 'Bersihkan komponen dan pengecekan fungsi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan display Radar dengan pembersih display mengunakan kain halus</li><li>Cek mouse</li><li>Cek fungsi dari masing-masing menu di radar. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:27:15', 20220101, 2, '2022-01-01', 1),
(158, '2022-01-01', 'P.401010101000/6B', 5, 5, 9, 9, 8, 35, 0, 'Marine Radar', 'Periksa, bersihkan dan perbaiki komponen yang rusak', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa dan perbaiki baut antena dari korosi dan kencangkan, Ganti baut yang berkarat. Lapisi baut baru dengan sealant anti korosi</li><li>Periksa unit antena apakah ada benda asing pada unit antena, Bersihkan unit antena dengan kain yang dibasahi air tawar atau alcohol, Jangan gunakan pembersih komersial untuk membersihkan unit antena karena dapat menghilangkan cat dan tanda atau merusak peralatan </li><li>Periksa unit Antena dari keretakan. Kerusakan permanen pada sirkuit unit akan terjadi jika air bocor di dalam</li><li>Bersihkan kotak display dan LCD, lap LCD dengan hati-hati agar tidak tergores menggunakan kertas tisu dan pembersih LCD </li><li>Cek apakah ada Fault atau Parameter yang tidak sesuai dengan Manual Book </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:26:53', 20220101, 8, '2022-01-01', 1),
(159, '2022-01-01', 'P.401010102000/B', 5, 5, 9, 9, 8, 35, 0, 'Kompas Magnet', 'Pembersihan komponen dan cek koneksi perkabelan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Buka cover pada magnetic sonde</li><li>Bersihkan dengan kain halus jika kotor </li><li>Cek koneksi kabel pada magnetic sonde. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:28:47', 20220101, 4, '2022-01-01', 1),
(160, '2022-01-01', 'P.401010102000/3B', 5, 5, 9, 9, 8, 35, 0, 'Kompas Magnet', 'Pembersihan komponen dan cek koneksi perkabelan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Buka tutup pelindung pada compass magnet</li><li>Bersihkan junction box jika kotor</li><li>Cek koneksi perkabelan. Laporkan pada perwira pengawas jika ada kelainan. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:27:40', 20220101, 6, '2022-01-01', 1),
(161, '2022-01-01', 'P.401010102000/6B', 5, 5, 9, 9, 8, 35, 0, 'Kompas Magnet', 'Pengecekan Earth Bonding dan Pembersihan Korosi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek secara visuil Earth Bonding dan Earth Straps </li><li>Lepaskan Baut/Mur penyangga peralatan. Bersihkan bagian yang korosi dengan Wire Brush dan kain kering sampai mengkilap </li><li>Lakukan pengukuran Earth Bonding Continuity </li><li>Tempatkan satu ujung alat tes pada bagian tidak ber cat di kapal, sedangkan ujung yang satunya pada bagian peralatan</li><li>Operasikan Insulation/Continuity tester dan cek hasil. (Continuity Resistance max 0,1 Ohm)</li><li>Jika hasil melebihi batas maksimum, periksa bonding, perbaiki dan laksanakan tes ulang</li><li>Jika hasil memuaskan, olesi Baut/Mur dengan Grease</li><li>Pasang kembali peralatan, kencangkan Baut/Mur </li><li>Pastikan Baut dan Mur penyangga Earth Bonding kencang </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:28:24', 20220101, 8, '2022-01-01', 1),
(162, '2022-01-01', 'P.401010103000/T', 5, 5, 9, 9, 8, 48, 0, 'Echo Sounder', 'Periksa koneksi kabel dan ground unit display dari korosi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa kabel Transduser dari kerusakan</li><li>Periksa kabel daya Transduser apakah terpasang erat. Pasang kembali jika perlu</li><li>Periksa ground unit Display dari korosi. Bersihkan jika perlu </li><li>Periksa tegangan catu daya pastikan nilai tegangan sesuai dengan yang tertera pada label. Jika keluar dari nilai pada label, cek dan perbaiki atau ganti. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:31:25', 20220101, 9, '2022-01-01', 1),
(163, '2022-01-01', 'P.401010104000/B', 5, 5, 9, 9, 8, 49, 0, 'Gyro Compass', 'Lakukan pemeliharaan GYRO COMPASS', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Matikan power tegangan 220VAC dan 24VDC pada switch breaker</li><li>Tunggu sampai beberapa jam kira kira 4 jam</li><li>Buka cover pada gyro compass</li><li>Lepas fuse pada gyro compass</li><li>Cek cairan pada measuring cone ( indicator cairan ) apakah masih penuh/ kosong. Jika cairan berkurang laporkan pada perwira pengawas untuk dilaksanakan pergantian/penambahan cairan Gyro.</li><li>Bersihkan card card pada Gyro compass dengan menggunakan vacuum cleaner. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:32:58', 20220101, 4, '2022-01-01', 1),
(164, '2022-01-01', 'P.401010105000/T', 5, 5, 9, 9, 8, 35, 0, 'GPS', 'Cek sambungan kabel dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek sambungan kabel dari korosi, kendor atau terputus. Hubungkan/sambungkan kembali kabel yang kendor atau terputus. Ganti semua kabel yang rusak</li><li>Bersihkan Debu pada unit display dengan kain kering yang bersih. Jangan gunakan pembersih komersial untuk membersihkan peralatan karena dapat menghilangkan cat dan noda </li><li>Bersihkan LCD dengan hati-hati agar tidak tergores, gunakan kertas tisu dan pembersih LCD</li><li>Bersihkan antena dari bahan asing yang dapat mengurangi sensitivitas, gunakan kain yang dibasahi dengan air tawar. Jangan gunakan pembersih komersial untuk membersihkan karena dapat menghilangkan cat dan tanda</li><li>Bersihkan permukaan transduser dari kotoran yang menempel atau pertumbuhan laut dengan kayu tongkat atau amplas kelas halus. PERINGATAN BAHAYA SENGATAN LISTRIK MELIHAT </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:34:19', 20220101, 9, '2022-01-01', 1),
(165, '2022-01-01', 'P.401010106000/B', 5, 5, 9, 9, 8, 35, 0, 'GPS Portable', 'Lakukan pembersihan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan perangkat GPS dengan kain yang dibasahi larutan deterjen ringan. Lap sampai kering </li><li>Membersihkan Layar dengan kain yang lembut, bersih, dan tidak berbulu </li><li>Pastikan Port mini-USB harus tertutup rapat pada saat penggunaan </li><li>Jangan mencampur baterai baru dengan baterai bekas dan Jangan mencampur jenis baterai yang berbeda </li><li>Lepas baterai jika perangkat GPS tidak digunakan </li><li>Simpan perangkat GPS di tempat kering </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:34:52', 20220101, 4, '2022-01-01', 1),
(166, '2022-01-01', 'P.401010107000/B', 5, 5, 9, 9, 8, 35, 0, 'Speed Log', 'Pembersihan instrumen dan Pengecekan Simulasi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Buka switch power pesawat dan laksanakan pengetesan setelah 15 menit dari pemanasan</li><li>Cek simulasi akurasi dari kecepatan instrumen </li><li>Bersihkan debu pada instrumen bagian luar dan dalam, noda minyak, dan endapan garam dengan menggunakan kain pembersih. Bersihkan noda air dan minyak di sekitar Repeaters  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:35:54', 20220101, 4, '2022-01-01', 1),
(167, '2022-01-01', 'P.401010107000/3B', 5, 5, 9, 9, 8, 35, 0, 'Speed Log', 'Pemeriksaan Periodik Earthing/Grounding', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek resistansi grounding pada tiap bagian dengan Milliohm Meter, pastikan nilainya tidak boleh lebih dari 10 megaohm </li><li>Cek tahanan isolasi antara terminal power masuk dan casing bodi peralatan menggunakan Megaohm Meter pada saat power supply tidak terhubung dengan listrik kapal, pastikan nilainya tidak boleh lebih dari 10 megaohm </li><li>Cek tahanan isolasi antara lubang plug No. 1 atau No. 2 pada X2 dan bodi casing peralatan dengan Megaohm Meter, pastikan nilainya tidak boleh lebih dari 10 megaohm </li><li>Lepas sakering pada Control Board ZY-4-7C. Laksanakan pengecekan sakering. Jika putus, ganti dengan sakering yang baru. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:35:26', 20220101, 6, '2022-01-01', 1),
(168, '2022-01-01', 'P.401010107000/T', 5, 5, 9, 9, 8, 35, 0, 'Speed Log', 'Pengecekan Kondisi Koneksi Kabel antar Instrumen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek keadaan sambungan kabel antar instrumen dengan multimeter </li><li>Buka distribution Box. Cek apakah terdapat aliran listrik di dalam inti kabel satu per satu dengan menggunakan Multimeter atau Combined Universal Tool. Sambung kembali/perbaiki perkabelan dengan menggunakan solder</li><li>Buka ujung clamp konektor menggunakan Combined Universal Tool kemudian keluarkan inti kabel. Keringkan menggunakan Hot Blower </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:36:24', 20220101, 9, '2022-01-01', 1),
(169, '2022-01-01', 'P.401010108000/B', 5, 5, 9, 9, 8, 35, 0, 'Weather System', 'Periksa dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa Whip antenna dan Kawat antena dari kerusakan. Ganti jika rusak</li><li>Periksa korosi dan kencangkan sambungan. Pastikan dalam kondisi bersih dan tahan air, gunakan senyawa penyegel jika perlu</li><li>Periksa Kabel koaksial dari kerusakan dan kencangkan sambungan. Ganti jika rusak</li><li>Periksa kabel Power dan terminal Ground untuk koneksi yang ketat. Kencangkan jika kendur dan bersihkan atau ganti jika berkarat</li><li>Bersihkan unit dari debu dan kotoran dihilangkan dengan kain lembut. Jangan gunakan pelarut seperti bensin dan toulene untuk membersihkan unit karena dapat menghilangkan cat dan tanda atau merusak peralatan. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:36:56', 20220101, 4, '2022-01-01', 1),
(170, '2022-01-01', 'P.401010109000/B', 5, 5, 9, 9, 8, 35, 0, 'Wind Speed Direction Portable', 'Bersihkan dan periksa kondisi kabel data dan sambungan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa kondisi kabel data dan sambungan </li><li>Periksa tegangan catu daya </li><li>Bersihkan kotoran dan debu pada unit sensor dengan kain halus yang bersih yang telah dibasahi dengan cairan pembersih </li><li>Bersihkan kotoran dan debu yang melekat pada Display dengan kain halus yang bersih  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:37:22', 20220101, 4, '2022-01-01', 1),
(171, '2022-01-01', 'P.401010110000/2T', 5, 5, 9, 9, 8, 35, 0, 'Wind Direction Fixed', 'Lakukan pemeriksaan komponen dan lakukan kalibrasi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pemeriksaan cangkir sensor dan baling-baling dari kerusakan fisik (misalnya, penyok atau retak)</li><li>Pengamatan bahwa cangkir dan baling-baling bergerak bebas dan bersih dari penghalang.  Periksa suara bantalan saat beroprasi </li><li>Lakukan kalibrasi akurasi kecepatan angin operasional  0,5 m/s (1,8 km/jam) dengan akurasi arah angin  5  digunakan mengikuti R.M</li><li>Periksa kondisi semua saluran terbuka, kabel, konektor dan ikatan kawat/kabel dari tanda-tanda kerusakan </li><li>Periksa apakah struktur pendukung sensor (misalnya tiang, boom, menara, can truss) sejajar secara vertikal atau horizontal, diamankan dan diorientasikan dengan benar </li><li>Periksa kabel, klip kawat, turnbuckle, klem, baut, derek, penangkal petir, kabel/batang pentanahan dan kotak penutup untuk kekencangan dan atau fungsionalitas </li><li>Periksa kabel sensor, winch dari kerusakan dan kekeringan segel cuaca, lumasi dengan pelumas anti-seize seperti Coppercoat untuk kemudahan pengoperasian dan terhindar dari korosi</li><li>Memastikan bagian logam yang tidak terlindungi dari karat dicat dengan cat semprot berwarna yang tahan karat </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:38:15', 20220101, 10, '2022-01-01', 1),
(172, '2022-01-01', 'P.401010111000/B', 5, 5, 9, 9, 8, 35, 0, 'AIS (AutomaticIdentificationSystem)', 'Periksa dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa apakah semua konektor pada panel belakang unit transponder dan unit monitor tersambung dengan benar </li><li>Periksa kabel dari kerusakan. Ganti jika rusak </li><li>Periksa terminal ground pada unit monitor dan unit transponder dari karat. Bersihkan jika perlu </li><li>Periksa apakah kabel arde pada unit monitor dan unit transponder terpasang erat </li><li>Bersihkan kotoran dan debu dari unit dengan kain kering yang lembut. Untuk LCD, bersihkan dengan hati-hati agar tidak tergores, gunakan kertas tisu dan pembersih LCD</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:39:43', 20220101, 4, '2022-01-01', 1),
(173, '2022-01-01', 'P.401010112000/3B', 5, 5, 9, 9, 8, 35, 0, 'ECDIS (Electronic Chart Display', 'Bersihkan komponen dan periksa sambungan dan koneksi kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan LCD Ecdis dengan hati-hati agar tidak tergores. Untuk menghilangkan kotoran atau endapan garam, gunakan pembersih LCD, usap perlahan dengan kertas tisut</li><li>Ganti kertas sesering mungkin agar garam atau kotoran tidak menggores LCD. Jangan gunakan pelarut seperti pengencer, aseton atau benzena untuk membersihkan. Jangan gunakan pembersih berbahan kimia untuk membersihkan karena dapat menghilangkan cat dan tanda </li><li>Periksa apakah semua kabel tersambung dengan kuat dan tidak rusak. Kencangkan koneksi kabel yang kendur dan ganti kabel jika ada yang rusak atau terkelupas. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:40:20', 20220101, 6, '2022-01-01', 1),
(174, '2022-01-01', 'P.401010113000/3B', 5, 5, 9, 9, 8, 50, 0, 'Rudder Angle Indicator', 'Bersihkan instrumen dan periksa semua kabel dari gesekan atau kerusakan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan instrumen dengan kain lembab yang lembut. JANGAN menggunakan bahan kimia atau abrasif untuk membersihkan instrumen </li><li>Periksa semua kabel dari gesekan atau kerusakan lain pada pelindung luar, jika kendur kencangkan kembali dan ganti jika ada kerusakan. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:40:40', 20220101, 6, '2022-01-01', 1),
(175, '2022-01-01', 'P.401010114000/3B', 5, 5, 9, 9, 8, 51, 0, 'Engine Telegraph', 'Bersihkan engine Telegraph dari kotoran dan lakukan uji fungsi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan engine Telegraph dari kotoran dan debu dengan kain lembab yang lembut. JANGAN menggunakan bahan kimia atau abrasif untuk membersihkan instrumen </li><li>Periksa semua kabel yang terhubung pada perangkat dan pastikan kencang dan kuat, jika kendur kencangkan kembali dan ganti jika ada kerusakan </li><li>Lakukan uji fungsi masing masing tombol pada Engine Telegraph </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:41:03', 20220101, 6, '2022-01-01', 1),
(176, '2022-01-01', 'P.401010115000/T', 5, 5, 9, 9, 8, 52, 0, 'Clear View Sreen (CVS)', 'Bersihkan dan periksa CVS', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lepaskan mur kerucut menggunakan kunci pas yang disertakan dengan kotak alat sambil memegang tepi layar yang berputar </li><li>Dengan menggunakan ujung kunci pas yang lain, buka mur penjepit dan lepaskan, biarkan layar diangkat</li><li>Bersihkan gelas seperlunya dan bersihkan semua endapan garam atau kotoran di labirin tepi</li><li>Periksa lubang pembuangan di bagian bawah wiper sudah bersih</li><li>Pastikan bahwa permukaan layar yang berputar benar-benar bersih dan olesi minyak bersih yang sangat tipis pada saat pemasangan kembali.\r\n6.Pastikan ulir mur penjepit dan hub bersih</li><li>Bersihkan mur penjepit dan permukaan kaca mur kerucut. Oleskan lapisan tipis senyawa Duralac atau minyak tahan air ke permukaan layar yang berputar</li><li>Hapus semua senyawa atau lemak berlebih dari layar setelah mur kerucut dikencangkan kembali </li><li>Terapkan kembali daya ke sistem dan uji pengoperasian unit dan pastikan berfungsi dengan baik. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:41:53', 20220101, 9, '2022-01-01', 1),
(177, '2022-01-01', 'P.401010116000/B', 5, 5, 9, 9, 8, 35, 0, 'Horn', 'Bersihkan horn', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek dan bersihkan body horn dan konektor pada relai horn di depan dengan cukup baik</li><li>Bersihkan dengan cara membuka konektor di sisi tangki dan melepas solenoid klakson udara GROVER, Bersihkan  siput logam dari kotoran yang menempel</li><li>Bersihkan dengan cara menyeka silinder dan membersihkannya dan memasangnya kembali. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:42:47', 20220101, 4, '2022-01-01', 1),
(178, '2022-01-01', 'P.401010117000/6B', 5, 5, 9, 9, 8, 53, 0, 'Lampu Morse', 'Periksa semua gasket-gasket dan sambungan kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa semua gasket-gasket dan sambungan kabel </li><li>Periksa semua ulir dan baut sambungan </li><li>Bersihkan menggunakan kain halus dengan alkohol Reflektor dan front glass </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:43:11', 20220101, 8, '2022-01-01', 1);
INSERT INTO `kartu_pemeliharaan` (`id`, `tanggal`, `kode_pemeliharaan`, `id_komponen_pokok`, `id_komponen_sub_pokok`, `id_sistem`, `id_sub_sistem`, `id_pelaksana`, `id_lokasi`, `id_kapal`, `komponen`, `uraian_pemeliharaan`, `tindakan_pengamanan`, `prosedur`, `alat_kerja`, `jo`, `created_at`, `updated_at`, `user_create`, `id_periode`, `tgl_mulai`, `id_jenis_perawatan`) VALUES
(179, '2022-01-01', 'P.401010118000/6B', 5, 5, 9, 9, 8, 54, 0, 'Day Light Signal', 'Cek dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan kaca depan bagian luar sesuai kebutuhan. Membersihkan bagian dalam lampu sorot tidak diperlukan </li><li>Lakukan charging batterai dan pastikan lampu indikator charging menyala, tunggu sampai batterai terisi penuh dengan ditandai indikator charging off </li><li>Cek dan pastikan Daylight Signal berfungsi dengan baik, jika ada parts yang rusak segera lakukan penggantian. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:43:37', 20220101, 8, '2022-01-01', 1),
(180, '2022-01-01', 'P.401010119000/3B', 5, 5, 9, 9, 8, 55, 0, 'Lampu Navigasi', 'Bersihkan dan periksa semua gasket-gasket dan sambungan kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek dan bersihkan rumah lampu (casing) dari kotoran dan karat, cek kekedapan rumah lampu dan pastikan tidak ada air yang masuk ke dalam casing lampu navigasi </li><li>Lakukan pemeriksaan nilai resistansi pada lampu navigasi untuk mengetahui kerusakan akibat terbentuknya korosi </li><li>Periksa semua gasket-gasket dan sambungan kabel </li><li>Periksa semua ulir dan baut sambungan </li><li>Bersihkan menggunakan kain halus dengan alkohol Reflektor dan front glass </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:44:01', 20220101, 6, '2022-01-01', 1),
(181, '2022-01-01', 'P.401010120000/6B', 5, 5, 9, 9, 8, 56, 0, 'Search Light', 'Bersihkan dan periksa semua gasket-gasket dan sambungan kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa semua gasket-gasket dan sambungan kabel</li><li>Periksa semua ulir dan baut sambungan, oleskan grease bila perlu </li><li>Bersihkan menggunakan kain halus dengan alkohol Reflektor dan front glass </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:44:19', 20220101, 8, '2022-01-01', 1),
(182, '2022-01-01', 'P.401010121000/6B', 5, 5, 9, 9, 8, 57, 0, 'Sistem Alarm', 'Cek dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek secara visual kondisi peralatan harus dalam kondisi baik, tidak ada tanda tanda kerusakan </li><li>Cek dan tes back up battery, power supply, dan panel MCFA (Main Control Fire Alarm) melalui alat ukur </li><li>Bersihkan kotoran-kotoran yang menempel pada komponen-komponen dan panel MCFA (Main Control Fire Alarm) </li><li>Lakukan pengetesan sistem alarm, untuk mengetahui bahwa MCFA (Main Control Fire Alarm), detector, bell dan light indicator berfungsi dengan baik </li><li>Kalibrasi dan uji sensor alarm kebakaran termasuk detektor sensor asap, Heat Detector, Flame Detector dll </li><li>Uji suara alarm kebakaran dan melakukan simulasi </li><li>Periksa korosi pada baterai alarm kebakaran serta tanggal kadaluarsa. Lakukan pergantian baterai alarm (independen) kebakaran paling tidak 1 tahun sekali </li><li>Gunakan stabilizer atau UPS yang baik untuk menjaga tegangan yang diterima oleh power supply pada panel control sistem alarm </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:44:57', 20220101, 8, '2022-01-01', 1),
(183, '2022-01-01', 'P.401010122000/6B', 5, 5, 9, 9, 8, 35, 0, 'Teropong Binocular', 'Bersihkan Teropong&nbsp;', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Tiup lensa dengan alat peniup untuk menghilangkan partikel yang lebih besar. Pastikan tangan Anda bersih. Siapkan beberapa potong tisu </li><li>Teteskan dua tetes cairan pembersih lensa pada selembar tisu pembersih lensa (jangan pernah pada lensa). Bersihkan dengan lembut kotoran dari lensa</li><li>Pada lensa yang lebih besar, bersihkan hanya area kecil menggunakan tisu. Pada lensa yang terlalu kotor, usap menggunakan satu sapuan untuk setiap tisu, secara bergantian basah dan kering. Selalu hindari tekanan atau gesekan yang berlebihan. Lebih baik meninggalkan sedikit kotoran pada lensa daripada menggunakan terlalu banyak tekanan dan merusak lapisan. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:46:03', 20220101, 8, '2022-01-01', 1),
(184, '2022-01-01', 'P.401010123000/T', 5, 5, 9, 9, 8, 35, 0, 'VDR', 'Cek dan bersihkan VDR', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Lakukan pembersihan Untuk menghilangkan noda dari peralatan seka perlahan dengan kain lembut yang diresapi sedikit dengan detergen netral </li><li>Cek tanggal kadaluarsa back-up battery yang tertera di atas capsul, Jika masa kadaluwarsa back-up battery semakin dekat lakukan penggantian </li><li>Periksa kabel-kabel apakah ada tanda-tanda kerusakan, seperti lecet, terpotong atau sobek</li><li>Periksa apakah semua sambungan sudah kencang </li><li>Periksa sekring, Jika sekring putus LED BATERAI CADANGAN mungkin tidak menyala. Cari penyebabnya sebelum mengganti sekering </li><li>Lakukan penggantian Hard Disk jika peralatan berhenti merekam  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:46:45', 20220101, 9, '2022-01-01', 1),
(185, '2022-01-01', 'P.401010124000/T', 5, 5, 9, 9, 8, 35, 0, 'Celaga kemudi (steering whell)', 'Periksa dan bersihkan komponen dan isi ulang minyak jika indikator dalam kondisi tingkat rendah', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa secara visual dan bersihkan semua komponen setir kemudi </li><li>Cek pengoperasian menggerakkan tuas-tuas darurat di selonoid untuk menjalankan kemudi </li><li>Periksa oli hidrolik dari kontaminasi. Isi ulang minyak ketika ditemukan pada kondisi tingkat rendah</li><li>Periksa apakah pengukur tekanan dalam kondisi baik. Ganti jika tidak bekerja dengan benar</li><li>Lumasi tiller arms dan semua bagian yang bergerak, pin, celah silinder Dll </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:47:17', 20220101, 9, '2022-01-01', 1),
(186, '2022-01-01', 'P.401010125000/3B', 5, 5, 9, 9, 8, 35, 0, 'Navtex Receiver', 'Periksa komponen dan lakukan pengukran tahanan ground', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa apakah konektor pada panel belakang telah dikencangkan dengan kuat dan bebas dari karat</li><li>Periksa apakah sistem arde bebas dari karat dan kabel arde terpasang erat</li><li>Lakukan pengukran tahanan ground dan cek hasilnya (tahanan kontinuitas maksimal 0.1 ohm) </li><li>Pastikan terminal baterai bersih dan bebas karat </li><li>Periksa antena dari kerusakan. Ganti jika rusak </li><li>Debu dan kotoran pada keyboard dan layar tampilan dapat dihilangkan dengan kain lembut. Jangan gunakan pembersih kimia untuk membersihkan peralatan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:47:49', 20220101, 6, '2022-01-01', 1),
(187, '2022-01-01', 'P.401010126000/M', 5, 5, 9, 9, 8, 58, 0, 'Clinometer', 'Periksa dan bersihkan clinometer', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan bila ada benda-benda kecil yang bukan bagian dari alat ukur tersebut dengan hati hati </li><li>Clinometer sebaiknya digunakan hati-hati dan tidak terkena guncangan yang keras, karena dapat mengakibatkan rusaknya clinometer </li><li>Apabila telah digunakan disimpan pada tempatnya, jangan ditumpuk dengan alat ukur lain. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:48:16', 20220101, 2, '2022-01-01', 1),
(188, '2022-01-01', 'P.401010127000/B', 5, 5, 9, 9, 8, 59, 0, 'Barometer', 'Cek dan pastikan komponen berada pada ruangan yang mempunyai suhu tetap', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek dan pastikan ditempatkan pada ruangan yang mempunyai suhu tetap (Homogen) </li><li>Pastikan tidak kena angin dan sinar matahari secara langsung</li><li>Pastikan tidak ditempatkan dekat lalu-lintas orang </li><li>Cek Penerangan jangan terlalu besar, maximum 25 watt </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:48:49', 20220101, 4, '2022-01-01', 1),
(189, '2022-01-01', 'P.401010128000/M', 5, 5, 9, 9, 8, 60, 0, 'Thermometer', 'Bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Gunakan kain bersih untuk membersihkan termometer </li><li>Jika ada noda, gunakan kain bersih yang sebelumnya direndam dalam air dan detergen </li><li>Keringkan dengan kain bersih\r\n4.Jika memakai alkohol, pastikan tidak mengenai indikator </li><li>Hindari merendam termometer dalam air ataupun alkohol</li><li>Jangan gunakan benzene, thinner, bensin, atau pelarut lain </li><li>Hindari memakai ultrasonic washer untuk membersihkan termometer </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:49:18', 20220101, 2, '2022-01-01', 1),
(190, '2022-01-01', 'P.401010129000/B', 5, 5, 9, 9, 8, 35, 0, 'Megaphone', 'Bersihkan komponen dan periksa kabel sambungan', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa semua kabel. Jika rusak, ganti </li><li>Periksa koneksi. Kencangkan kembali jika perlu </li><li>Ukur tegangan input untuk memastikannya berada dalam tegangan pengenal </li><li>Bersihkan debu atau kotoran dari permukaan luar dengan kain kering yang lembut. Jangan gunakan pembersih berbahan kimia untuk membersihkan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:49:42', 20220101, 4, '2022-01-01', 1),
(191, '2022-01-01', 'P.402010102000/B', 5, 6, 10, 10, 8, 61, 0, 'Digital VLF-HF receiver RS EK4100', 'Cek dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek housing , connector dan panel operasi dari kerusakan. Bersihkan housing dan bagian dalam dengan menggunakan kain lap </li><li>Cek semua conector ground, sekrup, antena dan kencangkan bila ada yang longgar </li><li>Cek insulation dari semua hubungan kabel external dengan multitester </li><li>Cek indicator dan elemen pengoperasian dari kerusakan mekanik </li><li>Periksa headset dan socket dari kerusakan akibat pemeliharaan pengguna </li><li>Menutup tutup Socket jika tidak digunakan untuk mencegah kontak  dengan air dan zat asing dan selalu menjaga daerah konektor bersih </li><li>Bersihkan Headset dengan kain yang bersih dan lembut </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:50:13', 20220101, 4, '2022-01-01', 1),
(192, '2022-01-01', 'P.402010103000/M', 5, 6, 10, 10, 8, 61, 0, 'TRX/VHF AM LEN GTA50-B', 'Cek kabel dan bersihkan housing', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pastikan pasokan catu daya terjaga kestabilannya, dan sesuai dengan spesifikasi yang dibutuhkan </li><li>Bersihkan housing dengan kain kering yang lembut. JANGAN gunakan pelarut keras seperti bensin atau alkohol saat membersihkan, karena akan merusak permukaan receiver </li><li>Cek cable coaxial + Conector </li><li>Cek antena dan kelengkapannya </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:50:51', 20220101, 2, '2022-01-01', 1),
(193, '2022-01-01', 'P.402010104000/M', 5, 6, 10, 10, 8, 61, 0, 'TRX VHF/UHF-AM/FM JOTRON', 'Bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan housing dengan kain lembut kering </li><li>Gunakan sikat untuk membersihkan bagian yang sulit dijangkau </li><li>Jika peralatan sangat kotor, bersihkan dengan kain yang dibasahi air soap solution dan keringkan dengan kain lap kering </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:51:59', 20220101, 2, '2022-01-01', 1),
(194, '2022-01-01', 'P.402010104000/3B', 5, 6, 10, 10, 8, 61, 0, 'TRX VHF/UHF-AM/FM JOTRON', 'Lakukan pemeriksaan dan pembersihan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Jika ada kerusakan fisik seperti patah, antena harus diganti </li><li>Pastikan antena terjangkau dengan kabel dan tidak dekat bahan logam di sekitarnya. Bila perlu, re-span antenna </li><li>Pastikan insulator terpasang dengan rekat dan tidak berkarat. Jika insulator rusak, ganti insulator </li><li>Bersihkan antena dari garam yang menumpuk, gunakan air tawar dan keringkan </li><li>Hilangkan karat antena </li><li>Kencangkan mur dan baut antena </li><li>Oleskan sealing compound pada permukaan logam antena </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:51:30', 20220101, 6, '2022-01-01', 1),
(195, '2022-01-01', 'P.402010105000/3B', 5, 6, 10, 10, 8, 61, 0, 'TRX VHF-FM HT Merk Sailor', 'Pemeliharaan komponen HT VHF Fm', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan housing dengan kain lembut kering, Gunakan sikat untuk membersihkan bagian yang sulit dijangkau </li><li>Jika ada kerusakan fisik seperti antena patah, antena harus diganti </li><li>Bersihkan antena dari kotoran dan garam yang menumpuk, gunakan air tawar dan keringkan </li><li>Hilangkan karat pada antenna </li><li>Bersihkan lubang ventilasi speker dan mic dari kotoran </li><li>Periksa baterai HT dari kerusakan seperti baterai kembung atau tidak bisa dicharge </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:52:28', 20220101, 6, '2022-01-01', 1),
(196, '2022-01-01', 'P.402010106000/6B', 5, 6, 10, 10, 8, 35, 0, 'SART Radar Transponder', 'Pemeliharaan Pengecekan Visual Dan Test Run', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pindahkan transponder SART dari braketnya\r\n1.Pastikan tidak ada kerusakan pada komponen </li><li>Putar switch ke posisi Test dan tahan selama beberapa detik. Lampu berkedip menandakan SART 20 bekerja dengan baik </li><li>Cek tampilan radar pada skala 10 NM, apabila muncul tampilan pola pada baringan sesuai posisi SART 20 terhadap radar, maka SART bekerja dengan baik </li><li>Lepaskan switch setelah selesai pengetesan</li><li>Kembalikan transponder SART pada bracket </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:53:50', 20220101, 8, '2022-01-01', 1),
(197, '2022-01-01', 'P.402010106000/4T', 5, 6, 10, 10, 8, 35, 0, 'SART Radar Transponder', 'Lakukan pemeliharaan baterai', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pindahkan transponder SART 20 dari braketnya </li><li>Buka transponder dengan memutar cincin sekrup berlawanan arah jarum jam </li><li>Lepas baterai unit (bagian bawah) dengan melepas sambungan baterai </li><li>Pastikan O-ring berada di bagian upper part transponder </li><li>Sambungkan dan pasang baterai baru, tutup transponder dengan memutar cincin sekrup searah jarum jam </li><li>Laksanakan Test Transponder </li><li>Catat waktu pengecekan selanjutnya </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:53:21', 20220101, 12, '2022-01-01', 1),
(198, '2022-01-01', 'P.402010107000/6B', 5, 6, 10, 10, 8, 35, 0, 'EPIRB Beacon', 'Pemeliharaan Function Test', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pindahkan EPIRB dari Storage </li><li>Tekan tombol Test SELAMA 15 DETIK</li><li>Setelah 5 detik, akan otomatis mengecek tegangan baterai, output power dan frekuensi</li><li>Tes berhasil setelah lampu menyala satu kali, beacon bekerja dengan benar</li><li>Pastikan Self test Otomatis berhenti dan tunggu selama 40 detik </li><li>Kembalikan EPIRB ke Storage setelah pengetesan </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:54:33', 20220101, 8, '2022-01-01', 1),
(199, '2022-01-01', 'P.402010108000/B', 5, 6, 10, 10, 8, 35, 0, 'FAX WEATHER', 'Periksa dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan unit dari debu dan kotoran, bersihkan dengan kuas dan kain lembut</li><li>Periksa Whip antenna dan Kawat antenna dari kerusakan. Ganti jika rusak </li><li>Periksa Kabel dari kerusakan dan kencangkan sambungan. Ganti jika rusak </li><li>Periksa kabel Power untuk koneksi yang ketat dan baterai Furuno FAX </li><li>Periksa terminal Ground untuk koneksi yang ketat dan tidak korosi. Ganti jika berkarat </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:54:58', 20220101, 4, '2022-01-01', 1),
(200, '2022-01-01', 'P.402010109000/6B', 5, 6, 10, 10, 8, 62, 0, 'GMDSS', 'Periksa secara visual koneksi kabel dari keusakan/korosi', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa secara visual koneksi kabel dari keusakan/korosi. Jika ada korosi Lepaskan baut/mur, bersihkan menggunakan wire brush/ kain halus</li><li>Pastikan Baut / Mur pada peralatan kencang.</li><li>Ukur tahanan ground secara berkala, Tempatkan satu ujung tester pada bagian kapal yang tidak di cat dan ujung lainnya pada peralatan yang akan di cek</li><li>Operasikan tester dan cek hasilnya (tahanan kontinuitas maksimal 0.1 ohm)</li><li>Jika test gagal laksanakan pengecekan dan lakukan kembali pengetesan, jika test memuaskan segel dengan menggunakan Petroleum Jelly</li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:59:32', 20220101, 8, '2022-01-01', 1),
(201, '2022-01-01', 'P.402010110000/6B', 5, 6, 10, 10, 8, 35, 0, 'Lampu Aldis', 'Bersihkan dan periksa semua gasket-gasket dan sambungan kabel', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa semua gasket-gasket dan sambungan kabel </li><li>Periksa semua ulir dan baut sambungan </li><li>Bersihkan menggunakan kain halus dengan alkohol Reflektor dan front glass </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 09:59:52', 20220101, 8, '2022-01-01', 1),
(202, '2022-01-01', 'P.402020101000/M', 5, 6, 11, 11, 8, 63, 0, 'Automatic Telephone', 'Pengecekan dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek housing, connector dan panel operasi dari kerusakan. Bersihkan housing dengan kain lap </li><li>Cek indicator dan elemen pengoperasian dari kerusakan mekanik </li><li>Periksa seluruh terminal, plugs, socket dan kondisi seluruh unit </li><li>Cek tombol tombol pada papan tombol yakinkan tidak ada yang rusak</li><li>Cek gagang telepon yakinkan speaker dan microfone berfungsi normal</li><li>Bersihkan komponen-komponen dan switch-switch </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:00:34', 20220101, 2, '2022-01-01', 1),
(203, '2022-01-01', 'P.402020102000/T', 5, 6, 11, 11, 8, 63, 0, 'Public Address System', 'Cek kondisi  perkabelan dan komponen sistem', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek kondisi umum perkabelan dan komponen seluruh sistem </li><li>Cek respon frekuensi dan tingkat kebisingan penguat harus diperiksa </li><li>Susunan pembumian/grounding harus dipelihara dengan baik. Induksi arus bolak-balik dengung pada 50 Hz dan harmoniknya juga harus diperiksa. </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:01:24', 20220101, 9, '2022-01-01', 1),
(204, '2022-01-01', 'P.402020103000/M', 5, 6, 11, 11, 8, 61, 0, 'Audio Matric Navysys Intercom', 'Pengecekan komponen dan bersihkan housing', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek housing, connector dan panel operasi dari kerusakan. Bersihkan housing dengan kain lap </li><li>Cek indicator dan elemen pengoperasian dari kerusakan mekanik </li><li>Periksa seluruh terminal, plugs, socket dan kondisi seluruh unit </li><li>Cek tombol tombol pada papan tombol yakinkan tidak ada yang rusak</li><li>Cek gagang telepon yakinkan speaker dan microfone berfungsi normal</li><li>Setelah digunakan Headset dan Socket disimpan dan rapi</li><li>Bersihkan komponen-komponen dan switch-switch </li><li>Menutup tutup Socket jika tidak digunakan untuk mencegah kontak dengan air dan zat asing, selalu menjaga daerah konektor bersih </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:02:03', 20220101, 2, '2022-01-01', 1),
(205, '2022-01-01', 'P.402020104000/B', 5, 6, 11, 11, 8, 64, 0, 'CCTV', 'Cek konektor,  keakuratan waktu, indikator, serta cek kondisi NVR', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Bersihkan lensa kamera, Housing, Drive Unit, NVR dari kotoran dan debu </li><li>Cek status camera dan status hardis rekaman, pastikan berfungsi normal </li><li>Periksa konektor, kabel, NVR, Camera dari kerusakan </li><li>Cek dan perhatikan keakuratan jam dan waktu, indikator, serta cek kondisi NVR </li><li>Lakukan back-up data rekaman setiap bulan, atau tergantung berapa lama hardisk bisa menyimpan rekaman </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:02:31', 20220101, 4, '2022-01-01', 1),
(206, '2022-01-01', 'P.403010101000/6B', 5, 7, 12, 12, 8, 65, 0, 'Main Gun', 'Bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Pembersihan noda dan kotoran pada bodi dengan cara salurkan air pada cover/body meriam, cuci dengan lap </li><li>Periksa Cleats, Cross Joints, Sistem penguncian, pergerakan , Pin-pin engsel </li><li>Periksa seal karet </li><li>Periksa  Daerah-daerah utama (Point-point) Lumasi cover meriam </li><li>Lumasi mounting jika terjadi hambatan gerak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:02:57', 20220101, 8, '2022-01-01', 1),
(207, '2022-01-01', 'P.403010101000/T', 5, 7, 12, 12, 8, 65, 0, 'Main Gun', 'Cek, bersihkan dan berikan pelumas pada bagian yang bergerak', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Cek kinerja meriam </li><li>Amati perbedaan respon penembakan </li><li>Bersihkan laras meriam dan kotak amunisi </li><li>Pemberian pelumas pada bagian gear atas pada sisi pergerakan dengan stempet </li><li>Berikan pergerakan putaran agar stempet menempel rata pada tiap bagian gear </li><li>Periksa secara visual dan bersihkan panel dalam, Periksa bekerjanya rangkaian-rangkaian </li><li>Periksa isolasi panel dengan cara tes sambungan ground dari seluruh papan distribusi  </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:03:26', 20220101, 9, '2022-01-01', 1),
(208, '2022-01-01', 'P.403010102000/6B', 5, 7, 12, 12, 8, 66, 0, 'Auxiliary Gun', 'Pengecekan komponen dan uji mounting base', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Kosongkan peluru agar terhindar dari kejadian yang tidak diinginkan </li><li>Bersihkan body senapan dari debu dan jamur menggunakan lap kering dan lap basah untuk pembersihan noda </li><li>Bersihkan bagian trigger, grip senapan perlahan dengan lap kering</li><li>Lepaskan tiap bagian-bagian dari senapan untuk mengecek fungsi dari pengunci/pengikat tiap komponen </li><li>Uji mounting base, Lumasi mounting jika terjadi hambatan gerak </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:05:50', 20220101, 8, '2022-01-01', 1),
(209, '2022-01-01', 'P.403010102000/T', 5, 7, 12, 12, 8, 66, 0, 'Auxiliary Gun', 'Periksa dan bersihkan komponen', 'Sesuai prosedur keamanan dan perhatikan petunjuk keselamatan kerja', '<div><u>Prosedur Perawatan :</u><br></div><ol><li>Periksa mur dan nut pada pengunci </li><li>Lepaskan penahan bahu dari sambungan, bersihkan secara merata </li><li>Amati tiap pergerakan dari setiap pengoperasian </li><li>Lepaskan tiap bagian - bagian dari senapan untuk mengecek fungsi dari pengunci/pengikat tiap komponen </li></ol>', 'Senter, Kain Lap, Kunci-kunci, dll', '0', '2022-01-01 14:32:17', '2022-01-20 10:06:16', 20220101, 9, '2022-01-01', 1),
(210, NULL, 'e3q', 5, 5, 11, 11, 6, 65, 8, 'af4wgsdzf', '<p>afd</p>', '<p>afxc</p>', '<p>efdc</p>', '<p>dsgerv</p>', 'sfw4esdf', '2023-02-26 08:41:59', '2023-02-26 08:41:59', NULL, 31, '2023-02-16', 2),
(211, NULL, 'FVCXVX', 4, 5, 10, 10, 7, 65, 6, 'UHF6DU7', '<p>6GS6F</p>', '<p>HBXBY</p>', '<p>HBDYV</p>', '<p>HBXHYBTVG</p>', NULL, '2023-02-28 11:33:30', '2023-02-28 11:33:30', NULL, 33, '2023-02-02', 2);
