INSERT INTO `komponen_sub_pokok` (`id`, `kode_sub_pokok`, `nama_sub_pokok`, `keterangan`, `created_at`, `updated_at`) VALUES
(2, 'P.201000000000', 'PEMBANGKIT LISTRIK POKOK ', 'NULL', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
